(19, 338, NULL, '<p><strong><em>Introducci&oacute;n a la Higiene y Seguridad Laboral</em></strong></p>', '0001-00019'),
(20, 930, NULL, '<p>De la Propuesta de IPRODICH de organizar capacitaciones orientadas al Empleado publico con el fin de tomar conciencia de la Inclusi&oacute;n de Personas con discapacidad (desde todos aspectos) a los efectos de proponer una sociedad mas inclusiva.</p>\r\n<p>El Area que propongo tratar es la Accesibilidad desde el aspecto f&iacute;sico, vale decir desde la arquitectura, como debemos atender a las personas con discapacidad, ya sea motora, sensorial o mental. Como deben ser los espacios, las circulaciones, el Servicio Sanitario, Los &nbsp;ambientes de Trabajo y Espera, y los espacios urbanos, el mobiliario urbano, etc.</p>\r\n<p>Arquitecto INGLANT, Jos&eacute;</p>\r\n<p>&nbsp;</p>', '0001-00020'),
(21, 340, NULL, '<p>ESTRES LABORAL &amp; AUSENTISMO:es un Metodo Natural secillo y sin Esfuerzo;basado en tecnicas de Respiracion,Relajacion y Meditacion&acute;, Cientificamente comprobado y recomendado por la Organozacion Mundial de la Salud. Tiene una duracion de 14hs. distribuidas en 7 dias.</p>\r\n<p>METODOLOGIA: consiste en un metodo educativo de interaccion sensoperceptivas global, orientado a integrar y potenciar las capacidades y habilidades de cada participante, entrenandolo individual y grupalmente, en el reconocimiento y ejercicio de su poder esencial.</p>\r\n<p>CONTENIDO: Estres laboral-Estres Docente-Desarrollo del potencial Creativo-Recursos Preventivos del Estres-Autocontrol emocional en situaciones de CONFLICTO.-Desarrollo de estilos de vida saludable y de la Autoestima-Claves para la prevencion del Estres-Naturaleza de lo Creativo-Rasgos del caracter Exitoso-Programacion de la accion Exitosa-Positivizacion del proposito, accion y resultado-Modelaje y recreaccion-LIDERAZGO:Alinaza y cooperacion. Reconocimiento de las propias capacidades.</p>\r\n<p>AREAS DE APLICACION:Administracion Publica, Educacion en todos los niveles, Deporte, Arte, Ciencia, Sicologia, Sociologia, Seguridad, y otros.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '0001-00021'),
(22, 340, NULL, '<p>ESTRES LABORAL &amp; AUSENTISMO:es un Metodo Natural secillo y sin Esfuerzo;basado en tecnicas de Respiracion,Relajacion y Meditacion&acute;, Cientificamente comprobado y recomendado por la Organozacion Mundial de la Salud. Tiene una duracion de 14hs. distribuidas en 7 dias.</p>\r\n<p>METODOLOGIA: consiste en un metodo educativo de interaccion sensoperceptivas global, orientado a integrar y potenciar las capacidades y habilidades de cada participante, entrenandolo individual y grupalmente, en el reconocimiento y ejercicio de su poder esencial.</p>\r\n<p>CONTENIDO: Estres laboral-Estres Docente-Desarrollo del potencial Creativo-Recursos Preventivos del Estres-Autocontrol emocional en situaciones de CONFLICTO.-Desarrollo de estilos de vida saludable y de la Autoestima-Claves para la prevencion del Estres-Naturaleza de lo Creativo-Rasgos del caracter Exitoso-Programacion de la accion Exitosa-Positivizacion del proposito, accion y resultado-Modelaje y recreaccion-LIDERAZGO:Alinaza y cooperacion. Reconocimiento de las propias capacidades.</p>\r\n<p>AREAS DE APLICACION:Administracion Publica, Educacion en todos los niveles, Deporte, Arte, Ciencia, Sicologia, Sociologia, Seguridad, y otros.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '0001-00022');
