INSERT INTO `contacto` (`id`, `nombreYapellido`, `telefono`, `email`, `mensaje`) VALUES
(2, 'Sebastián Khairallah', '3624391915', 'sebaskhairallah@outlook.com', 'Ministerio de infraestructura. Recursos Humanos'),
(5, 'CHIARELLI JORGE MARTIN', '362 4856995', 'martyn2109@hotmail.com', 'soy empleado publico cumplo servicio en IPDUV, quisiera saber sobre cursos de capacitación o si hay algún cronograma. gracias'),
(6, 'pamela lilian colabianchi', '3624-304383', 'pamelagobierno@gmail.com', 'Buenos días, quisiera saber si ya hay cursos disponibles y cuales?'),
(7, 'rodas cristian mareclo', '3624886350', 'rodasmarcelo09@hotmail.com', 'buenas  tgardes  quisiera  saber  si este  año  se  van a  realizar  cursos virtuales  para  los  empleados de la administracion publica  y  se  me  pueden  enviar informacion al respecto desde ya  muchas gracias  saludos cordilaes'),
(8, 'Elba Zulema Calderon', '03735 492190', 'elbacalfacu@gmail.com', 'Hola, Soy Elba de Santa Sylvina, estaba observando las noticias que publica el Ipap y me interesa muchísimo realizar la capacitación sobre "Reglamentaciones vigentes en materia de personal". La consulta que quiero realizar es si existe la posibilidad de hacerlo a través del aula virtual, ya que de otra manera me es imposible!!  Desde ya Muchas Gracias!!!'),
(9, 'hector marcelo bellini', '3624407228', 'meduc.centelfonica@ecomchaco.com.ar', 'Solicito informacion oferta cursos para la administracion publica, ingrese recientemente a planta en el Ministerio de Educacion y me gustaria capacitarme para poder desarrollar mejor mis funciones administrativas. Mi formacion es mas tecnica y mis conocimientos administrativos son escasos.\r\nespero respuestas saludos.'),
(10, 'Alfredo Hugo Velazco', '4422901 - Interno 8812', 'ahvb1801@hotmail.com', 'Estoy interesado en inscribirme en el curso "LIDERASGO EN ACCION"'),
(11, 'sully coll', NULL, 'sc2@live.com.ar', 'Me gustaria saber mas acerca del curso de liderazgo, quisiera inscribirme hay problemas en su pagina porque no accede a la inscripcion - Pertenezco al Ministerio de Salud Publica, Y Soy Jefe de Departamento Administrativo de la Subsecretaria de Atención de la Salud. Sobre todo por horario del dictado del curso y si es on line. Desde ya muchas gracias.'),
(12, 'Roberto Lopez', '3624316991', 'lic.bangher@hotmail.com', 'Buenos dias queria inscribirme al Curso "Atencion al Ciudadano" pero me solicita usuario y contraseña como debo hacer para obtenerlos? Gracias'),
(13, 'Ana María Sandoval', '3624810577', 'anamasan34@yahoo.com.ar', 'por favor me podrian informar si los cursos CURSO: INTEGRACIÓN DE HERRAMIENTAS BÁSICAS (WINDOWS, WORD, EXCEL, ACCESS) el personal se inscribe virtualmente o desde el area tenemos que inscribirlo? soy del Instituto de Cultura. gracias'),
(14, 'gabriela', '.', 'gabrielaberndt@yahoo.com.ar', 'CURSO VIRTUAL “Servicio de Atención al Ciudadano” como se llevara a cabo? en su sede en la Peatonal en que horarios?'),
(15, 'veronica chomik', '3624617711', 'veritochomik@hotmail.com', 'buenas quisiera inscribirme en los cursos de capacitación existentes.Gracias.'),
(16, 'José Omar Gallardo', '3794674987', 'jgallardo@insssep.gov.ar', 'DNI 1845645 - InSSSeP - Av. 9 de Julio 347 (Centro de Procesamiento Informático)\r\nCuando registro mis datos personales e intento grabarlos. recibo el error "500 - hubo un error al procesar la información". \r\nMuchas GRacias'),
(17, 'SABO SANDRA ELENA', '0362-4813691', 'sabosandra@hotmail.com', 'quiero registrarme para el Curso SERVICIOS DE ATENCION AL CIUDADANO , TRABAJO EN EL InSSSep, pero no puedo registrarme-COMO HAGO???'),
(18, 'pablo hidalgo', NULL, 'pablohidalgo60@hotmail.com', 'hola buenos dias tengo un problema en la pre-inscripcion en el curso de atencion del usuario y me sale "cuenta desactivada" por favor podian verificar mi inscripcion gracias'),
(19, 'Massara Susana', '3624613368', 'susimassara@hotmail.com', 'quise activar , pero no puedo porque la direccion de correo que quedo registrada es susimassara@hotmail.com.ar, pero en realidad la direccion es susimassara@hotmail.com, no tiene que tener el ar'),
(20, 'Ocampo Estefania Valeria', '154668527', 'estefania_ocampo@yahoo.com.ar', 'hola! Quisiera, por favor me asistieran respecto de un inconveniente que tengo. El día 16/05 me he registrado como usuario de IPAP para inscribirme en el curso virtual de "atención al ciudadano", no he tenido inconvenientes respecto a la registración y confirmación como usuario, pero en cuanto a la pre-inscripción del curso virtual, no he recibido usuario y clave  en mi correo electrónico para ingresar en la platafroma E- learning. El sistema hasta el día 19 me informaba que estaba pre-inscripta . pero a la hora de confirmar dicha pre-inscricpción, no se me habilitó tal acción; en mi estado actual, al día de la fecha ya no figuro ni siquiera como pre-inscripta al curso. siendo 21 de mayo aun no he podido tener acceso al mismo.. a la espera de una pronta respuesta. saludo  a uds. atte.'),
(21, 'Jesus Juan Jose Ojeda', '03624-530545', 'juanjo011@hotmail.com', 'Cumplo en dirigirme a Ud., a los efectos de se contemple la posibilidad de inscribirme en el curso de capacitación sobre INFORMACION SUMARIA Y SUMARIOS ADMINISTRATIVOS.\r\n\r\nNombre y Apellido: Jesús Juan José OJEDA.\r\nDNI. Nº 30.789.571.\r\nTel. Cel. 03624-530545.\r\nCargo/función: Oficial Auxiliar de Policía'),
(22, 'Armando Diego BARBONA', '3624684057', 'AMPO1@HOTMAIL.ES', 'SOLICITO INSCRIBIRME CURSO DE INFORMACION SUMARIA Y SUMARIO ADMINISTRATIVO'),
(23, 'mirta alejandra grazziano', '3624302504', 'pinki_1973@hotmail.com', 'buen dia quisiera saber por que aun no me ha llegado ningun material del curso a mi correo, gracias'),
(24, 'pablo hidalgo', '03624513241', 'pablohidalgo60@hotmail.com', 'Hola buenos dias por favor quisiera saber si puedo recuperar la Leccion 1 ya que por motivos de salud no pude realizarla a tiempo. si es asi indicarme fecha por favor porque estoy muy interresado en el curso desde ya muchas gracias y a su disposicion Pablo Hidalgo'),
(25, 'incripcion a curso sumario administrativo', NULL, 'adrigabi007@gmail.com', 'quiero podes inscribirme en el curso de capacitación SUmario ADministrativo, estoy a cargo del Departamento Administrativo de la Subsecretaria deNIñez DOMINGUEZ ADRIANA G- DNI Nº 28858573'),
(26, 'Graciela Escobar', '3624683212', 'lavalle1054@yahoo.com', 'Buenos dias quisiera saber si me pueden confirmar la inscripción al curso sobre Sumario  administrativo que inicia mañana. Muchas Gracias'),
(27, 'Elba Calderón', '03735 492190', 'elbacalfacu@gmail.com', 'Hola!! estoy observando la página donde se ofrecen diferentes cursos de capacitación `presenciales, donde se pueden elegir los días y los horarios para capacitarse... Qué bueno sería que que lo dicten también en el interior!! Soy de Santa Sylvina y me encantaría realizar esos cursos!!! a lo mejor lo pueden hacer 2 veces en el mes!! intensificar los horarios y nosotros podemos llevar  las computadoras!! Es una sugerencia nada más!! Saludos'),
(28, 'SOFIA LILIAN CACERES', '03624478868-154719753', 'socinren@hotmail.com', 'buenos noches quisiera saber información para inscribirme en cursos de  word'),
(29, 'gines eduardo', '3624 562524', 'eduardogines@yahoo.com.ar', 'hola quisiera inscribirme en excel avanzado  trabajo en el ministerio de educacion . como  administrativo'),
(30, 'Escobar Soledad Gisela', '3624629424', 'sol_esc07@hotmail.com', 'Buenos días mi consulta es ¿cómo me puedo inscribir en el curso que da comienzo el 23 de mayo?'),
(31, 'Prado Diego Hernan', '3624514625', 'diego_hernan718@hotmail.com', 'Buenos Días Deseo saber si estoy preinscripto para el curso de Word Basico, a llevarse a cabo desde el 10/06/14 hasta 10/07/14, en la U.T.N'),
(32, 'Sergio Geniadieff', '3624776681', 'sergiogeniadieff@gmail.com', 'Estoy finalizando el curso de e-learning pasado mañana. y aprovecho y pruebo como funciona este medio y su correo, cariños de su amigo Sergio Geniadieff, alias "el pelado", abrazos.'),
(33, 'ARANDA SARA', '03624484794', 'noemi27_99@hotmail.com', 'Me comunico con ustedes a efectos de avisar que no concurrire mas al curso de Excell avanzado que se dicta en la sede de la UTN en el horario de 10 a 12:30 los dias lunes y miercoles debido a que el contenido que se dicta yo ya lo manejo correctamente. Pido las disculpas del caso debido a los contratiempos que puede generar esto agradeciendo la oportunidad que brindan a los agentes de esta Adeministracion Publica.'),
(34, 'Ruiz Diaz Juan Marcelo', '4414900', 'marcelorzdz@hotmail.com', 'Hola, le quiero hacer una consulta, somos empleados del Ministerio de Educación "Centro de Gestión e Información" y quiero saber como podemos realizar la capacitación  "Taller de Atención, comunicación y trabajo" desde ya saludos.-'),
(35, 'Felicitas Fernanda Ayala', '(362)4136645', 'feliayala32@yahoo.com.ar', 'hola, buenos días, quisiera pre-inscribirme al curso de digitalización de documentos de archivo pero no me permite, me parece mas que interesante  esta capacitación, soy archivista y trabajo en RRHH del instituto de cultura, en el departamento LEGAJOS, es por ello que me interesa la capacitación, estoy realizando el curso de Excel básico, atención al usuario me he inscripto pero ya he realizado el curso en años anteriores, solo leo los apuntes que facilita el docente, que me parece mas que interesante, el certificado  ya lo tengo, espero respuestas a mi solicitud, muchas graciassssss'),
(36, 'Gladis Yurchuk', '362-4789465', 'cgc.gladis@gmail.com', 'Estimados:\r\n                 Me he pre-inscripto al curso LIDERAZGO EN ACCIÓN modalidad e-learning, luego me comuniqué telefónicamente con el IPAP y me dijeron que me enviarían un correo informándome, el cual no lo ha recibido hasta el momento.'),
(37, 'Silvana Montiel', '3624448000 Interno 6511', 'cgc.montiel@chaco.gov.ar', 'Hola! No alcanzo a completar la inscripción al Curso Liderazgo en Acción - Modalidad e-learning(virtual). Me aparece ERROR "500"\r\nMuchas gracias!'),
(38, 'FRANCISCOMONTENEGRO', '362 4 448857', 'franciscomontenegro22@gmail.com', 'Tengo Problemas para la registracion al curso de Symphony2, me cree la cuentra pero al momento de realizar la pre-inscripcion me tira un error 500, que dice que "hubo un error al procesar la informacion", mañana a primera hora voy a estar contactandome con el centro del Ipap, con el Sr. Cesario, para enmendar, esta situacion.'),
(39, 'claudia rocío nera', '3624639980', 'claudia.nera@chaco.gov.ar', 'hola, quisiera consultarle a dónde me tengo que dirijir para pedir el certificado de asistencia al curso de la "Ley 4787" que realicé en el año 2013...muchas gracias!!'),
(40, 'ARANDA RUBEN DARIO', '4444759- 3624-305785', 'ceremonialdeporteshotmail.com', 'solicito acreditación al curso de "Oratoria Moderna: como hablar bien en público "'),
(41, 'Teófila Beatriz Ramírez', '362 154517296', 'bettyramirezfontana@yahoo.com.ar', 'Solicito inscripción al curso Formulación del Presupuesto Provincial. Aspectos prácticos'),
(42, 'Hernan Celedonio Gomez Cabrera', '03624432264', 'hernanceledonio@gmail.com', 'Buen dia, quisiera saber si los cursos son abiertos a la ciudadania en general o son exclusivos del personal administrativo provincial. Muchas gracias.'),
(43, 'susana benabidez', '0362883758', 'zuzanabenabidez@hotmail.com', 'hola buenos dias desearia saber si puedo ir inscribirme para el nuevo curso de liderazgo en modalidad virtual en caso afirmativo x favor indicar como debo hacerlo gracias'),
(44, 'ALMIRON ALICIA', NULL, 'aliciarit@hotmail.com', 'Buen día: quería saber si los contratados podemos hacer los cursos.'),
