(278, NULL, NULL, '<p>Tesis Licenciatura en Ciencias de la Informaci&oacute;n, tema "Funcionalidad de la relaci&oacute;n entre la informaci&oacute;n del Archivo Jurisdiccional y la &aacute;reas organizacionales del MInisterio de Gobierno,Justicia y Seguridad</p>', NULL, NULL, 1, NULL, '<p>Participaci&oacute;n en I,II y III Foro Internacional de Evaluaci&oacute;n de Documentos para Latinoamerica-Consejo Internacional de Archivos y Universidad de C&oacute;rdoba a&ntilde;os 2009,2010,2011 .</p>\n<p>Seminario de Gesti&oacute;n de Documentos Electr&oacute;nico-Facultade de Ciencias Jur&iacute;dicas de Universidad de FASTA.</p>\n<p>&nbsp;1995 Miembro de Comisi&oacute;n de Aplicaci&oacute;n de Sistema Provincial de Archivo-SIPAR-</p>\n<p>1996- Resoluci&oacute;n N&ordm; 232/96-Responsable del Ministerio de Gobierno,Justicia, ante la RENDIAP</p>\n<p>Integre las distintas Comisiones de la Asociaci&oacute;n de Archiveros de la Provincia del Chaco</p>\n<p>Participe en la Comisi&oacute;n de la Federaci&oacute;n Argentina de Archiveros</p>\n<p>Colabore en la Organizaci&oacute;n del IX Congreso Argentino de Archivistica, que se realizo en la ciudad de Resistencia-a&ntilde;o 2011</p>\n<p>Diserte en la 1&ordm; Jornadas de Archivistica en la ciudad de Santiago del Estero, Tema Sistema Provincial de Archivos-a&ntilde;o 2011</p>\n<p>Licenciatura en Ciencias de la Informaci&oacute;n,total materias aprobadas,elaborando la tesis.</p>'),
