(380, '<p>22 a&ntilde;os de experiencia en el &aacute;mbito provincial y nacional.</p>', '<p>Director de tesinas de Licenciatura en Lenguas Extranjeras.</p>', '<p>Producci&oacute;n de materiales did&aacute;ctico-pedag&oacute;gico.&nbsp;</p>', NULL, NULL, 1, '<p>Ex-Profesor de la Facultad de Filosof&iacute;a y Letras de la Universidad de Buenos Aires (U.B.A.)&nbsp;</p>', '<p>Profesor universitario en la Facultad de Humanidades (U.N.N.E.)</p>'),
(381, '<h2>A continuaci&oacute;n se brinda una gu&iacute;a de carga de datos para este campo</h2>\n<ol>\n<li><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong><strong>Por cada actividad de ense&ntilde;anza universitaria de grado</strong></li>\n</ol>\n<p>1.1.Por concurso p&uacute;blico Categor&iacute;a docente -&nbsp;asignatura &ndash; Instituci&oacute;n</p>\n<p>1.2.&nbsp;Por concurso de antecedentes: Categor&iacute;a docente -&nbsp;asignatura &ndash; Instituci&oacute;n</p>\n<ol start="2">\n<li><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong><strong>Por cada actividad universitaria de posgrado</strong></li>\n</ol>\n<p>2.1 En carrera de posgrado en &aacute;reas de conocimiento referente a la administraci&oacute;n p&uacute;blica, el gobierno y las pol&iacute;ticas p&uacute;blicas (denominaci&oacute;n t&iacute;tulo - instituci&oacute;n que lo otorga - a&ntilde;o de egreso).</p>\n<p>2.2. En otras carreras de posgrado (denominaci&oacute;n t&iacute;tulo - instituci&oacute;n que lo otorga - a&ntilde;o de egreso).</p>\n<ol start="3">\n<li><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong><strong>&nbsp;Por cada actividad de ense&ntilde;anza en otro/s nivel/es educativo/s</strong></li>\n</ol>\n<p>3.1 Nivel terciario (Cargo - asignatura &ndash; instituci&oacute;n)</p>\n<p>3.2 Nivel secundario (Cargp - asignatura - instituci&oacute;n)</p>', '<h2 class="western" align="JUSTIFY"><span style="color: #000000;"><span style="font-size: medium;">Para recurso humano que usted haya formado, indicar (priorizar los &uacute;ltimos tres (3) a&ntilde;os)</span></span></h2>\n<ol>\n<li>\n<h2 class="western" align="JUSTIFY"><span style="color: #000000;"><span style="font-size: medium;">Para formaci&oacute;n de auxiliares en c&aacute;tedras:</span></span></h2>\n<ol>\n<li>\n<h2 class="western" align="JUSTIFY"><span style="color: #000000;"><span style="font-size: medium;">Instituci&oacute;n &ndash; Carrera &ndash; C&aacute;tedra - Apellido y Nombre del auxiliar formado, Categor&iacute;a de auxiliar (JTP, Auxiliar d 1ra, auxiliar de 2&ordf;da), per&iacute;odo</span></span></h2>\n</li>\n</ol></li>\n<li>\n<h2 class="western" align="JUSTIFY"><span style="color: #000000;"><span style="font-size: medium;">Para formaci&oacute;n de recursos humanos en Investigaci&oacute;n, Innovaci&oacute;n y Desarrollo </span></span></h2>\n<ol>\n<li>\n<h2 class="western" align="JUSTIFY"><span style="color: #000000;"><span style="font-size: medium;">Instituci&oacute;n &ndash; Proyecto &ndash; Apellido y Nombre del recurso humanos formado, Cargo (docente, becario) , per&iacute;odo</span></span></h2>\n</li>\n</ol></li>\n<li>\n<h2 class="western" align="JUSTIFY"><span style="color: #000000;"><span style="font-size: medium;">Para direcci&oacute;n de tesis</span></span></h2>\n<ol>\n<li>\n<h2 class="western" align="JUSTIFY"><span style="color: #000000;"><span style="font-size: medium;">Instituci&oacute;n, t&iacute;tulo de la tesis, tipo de tesina (grado, posgrado), Apellido y nombre del tesista &ndash; a&ntilde;o de aprobaci&oacute;n de la tesis.</span></span></h2>\n</li>\n</ol></li>\n</ol>', '<h2>Podr&aacute; agregar un m&aacute;ximo de 3&nbsp;(tres) antecedentes por cada &iacute;tem</h2>\n<h2>1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Proyectos &nbsp;acreditados:</h2>\n<h2>Para cada proyecto indicar: t&iacute;tulo del proyecto &ndash; rol dentro del proyecto &nbsp;- instituci&oacute;n &ndash; per&iacute;odo &ndash; c&oacute;digo de acreditaci&oacute;n del proyecto.</h2>\n<h2>2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>Proyectos de &nbsp;no acreditados:</strong></h2>\n<h2>Para cada proyecto indicar: t&iacute;tulo del proyecto &ndash; rol dentro del proyecto&nbsp; - instituci&oacute;n &ndash; per&iacute;odo</h2>', '<h2>A continuaci&oacute;n se brinda una gu&iacute;a de carga de datos para este campo</h2>\n<ol>\n<li>&nbsp;Libros (Autor - T&iacute;tulo - Editorial - Ciudad - A&ntilde;o)</li>\n<li>&nbsp;Cap&iacute;tulos de libro&nbsp;(Autor - T&iacute;tulo - Cap&iacute;tulo/s - Editorial - Ciudad - A&ntilde;o)</li>\n<li>Publicaciones en Revistas (Autores - T&iacute;tulo - Revista - Vol. N&uacute;mero - A&ntilde;o)</li>\n<li>Publicaciones en Congresos (Autores - T&iacute;tulo - Congreso - Lugar &nbsp;Fecha)</li>\n<li>Otras publicaciones, producci&oacute;n y/o transferencia (Ej, Gu&iacute;a de trabajos pr&aacute;cticos, apuntes electr&oacute;nicos, etc. )</li>\n</ol>', NULL, 0, '<p><strong>Aclaraci&oacute;n: en cada &iacute;tem,&nbsp; priorice los antecedentes&nbsp; de acuerdo a lo que registr&oacute; en el &iacute;tem Tem&aacute;ticas de capacitaci&oacute;n a las&nbsp; que se postula.</strong></p>\n<h2>1.&nbsp;Experiencia en Organismos P&uacute;blicos CENTRALIZADOS Y DESCENTRALIZADOS (no incluir a actividades de ense&ntilde;anza) &ndash; 3 ANTECEDENTES M&Agrave;S RECIENTES</h2>\n<p>1. Organismo - Funci&oacute;n - Fecha de ingreso/egreso</p>\n<p>2. Organismo - Funci&oacute;n - Fecha de ingreso/egreso</p>\n<p>3. Organismo - Funci&oacute;n - Fecha de ingreso/egreso</p>\n<h2>2. &nbsp;Experiencia en AMBITO PRIVADO&nbsp; (no incluir a actividades de ense&ntilde;anza) &ndash; 3 ANTECEDENTES M&Agrave;S RECIENTES</h2>\n<ol>\n<li>&nbsp;&nbsp;&nbsp;&nbsp;Empresa&nbsp; - Actividad /Cargo desempe&ntilde;ado -&nbsp; Fecha de ingreso/egreso.</li>\n<li>&nbsp;&nbsp;&nbsp;&nbsp;Empresa&nbsp; - Actividad /Cargo desempe&ntilde;ado -&nbsp; Fecha de ingreso/egreso.</li>\n<li>&nbsp;&nbsp;&nbsp;&nbsp;Empresa&nbsp; - Actividad /Cargo desempe&ntilde;ado -&nbsp; Fecha de ingreso/egreso.</li>\n</ol>\n<h2>&nbsp;</h2>', NULL),
