ilde;o)</li>\n<li>&nbsp;Cap&iacute;tulos de libro&nbsp;(Autor - T&iacute;tulo - Cap&iacute;tulo/s - Editorial - Ciudad - A&ntilde;o)</li>\n<li>Publicaciones en Revistas (Autores - T&iacute;tulo - Revista - Vol. N&uacute;mero - A&ntilde;o)</li>\n<li>Publicaciones en Congresos (Autores - T&iacute;tulo - Congreso - Lugar &nbsp;Fecha)</li>\n<li>Otras publicaciones, producci&oacute;n y/o transferencia (Ej, Gu&iacute;a de trabajos pr&aacute;cticos, apuntes electr&oacute;nicos, etc. )</li>\n</ol>', NULL, 1, '<p><strong>Aclaraci&oacute;n: en cada &iacute;tem,&nbsp; priorice los antecedentes&nbsp; de acuerdo a lo que registr&oacute; en el &iacute;tem Tem&aacute;ticas de capacitaci&oacute;n a las&nbsp; que se postula.</strong></p>\n<h2>1.&nbsp;Experiencia en Organismos P&uacute;blicos CENTRALIZADOS Y DESCENTRALIZADOS (no incluir a actividades de ense&ntilde;anza) &ndash; 3 ANTECEDENTES M&Agrave;S RECIENTES</h2>\n<p>1. Organismo - Funci&oacute;n - Fecha de ingreso/egreso<br />IPRODICH- Auditor y coordinador de la Junta evaluadora de prestadores de servicios para la atenci&oacute;n de personas con discapacidad-abril 2010/septiembre 2012</p>\n<p>2. Organismo - Funci&oacute;n - Fecha de ingreso/egreso</p>\n<p>3. Organismo - Funci&oacute;n - Fecha de ingreso/egreso</p>\n<h2>2. &nbsp;Experiencia en AMBITO PRIVADO&nbsp; (no incluir a actividades de ense&ntilde;anza) &ndash; 3 ANTECEDENTES M&Agrave;S RECIENTES</h2>\n<ol>\n<li>&nbsp;&nbsp;&nbsp;&nbsp;Empresa&nbsp; - Actividad /Cargo desempe&ntilde;ado -&nbsp; Fecha de ingreso/egreso.</li>\n<li>&nbsp;&nbsp;&nbsp;&nbsp;Empresa&nbsp; - Actividad /Cargo desempe&ntilde;ado -&nbsp; Fecha de ingreso/egreso.</li>\n<li>&nbsp;&nbsp;&nbsp;&nbsp;Empresa&nbsp; - Actividad /Cargo desempe&ntilde;ado -&nbsp; Fecha de ingreso/egreso.</li>\n</ol>\n<h2>&nbsp;</h2>', '<p>Experiencias en talleres y charlas en instituciones educativas, eclesi&aacute;sticas y no gubernamentales</p>'),
(383, '<h2>A continuaci&oacute;n se brinda una gu&iacute;a de carga de datos para este campo</h2>\n<ol>\n<li><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong><strong>Por cada actividad de ense&ntilde;anza universitaria de grado</strong></li>\n</ol>\n<p>1.1.Por concurso p&uacute;blico Categor&iacute;a docente -&nbsp;asignatura &ndash; Instituci&oacute;n</p>\n<p>1.2.&nbsp;Por concurso de antecedentes: Categor&iacute;a docente -&nbsp;asignatura &ndash; Instituci&oacute;n</p>\n<ol start="2">\n<li><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong><strong>Por cada actividad universitaria de posgrado</strong></li>\n</ol>\n<p>2.1 En carrera de posgrado en &aacute;reas de conocimiento referente a la administraci&oacute;n p&uacute;blica, el gobierno y las pol&iacute;ticas p&uacute;blicas (denominaci&oacute;n t&iacute;tulo - instituci&oacute;n que lo otorga - a&ntilde;o de egreso).</p>\n<p>2.2. En otras carreras de posgrado (denominaci&oacute;n t&iacute;tulo - instituci&oacute;n que lo otorga - a&ntilde;o de egreso).</p>\n<ol start="3">\n<li><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong><strong>&nbsp;Por cada actividad de ense&ntilde;anza en otro/s nivel/es educativo/s</strong></li>\n</ol>\n<p>3.1 Nivel terciario (Cargo - asignatura &ndash; instituci&oacute;n)</p>\n<p>3.2 Nivel secundario (Cargp - asignatura - instituci&oacute;n)</p>', '<h2 class="western" align="JUSTIFY"><span style="color: #000000;"><span style="font-size: medium;">Para recurso humano que usted haya formado, indicar (priorizar los &uacute;ltimos tres (3) a&ntilde;os)</span></span></h2>\n<ol>\n<li>\n<h2 class="western" align="JUSTIFY"><span style="color: #000000;"><span style="font-size: medium;">Para formaci&oacute;n de auxiliares en c&aacute;tedras:</span></span></h2>\n<ol>\n<li>\n<h2 class="western" align="JUSTIFY"><span style="color: #000000;"><span style="font-size: medium;">Instituci&oacute;n &ndash; Carrera &ndash; C&aacute;tedra - Apellido y Nombre del auxiliar formado, Categor&iacute;a de auxiliar (JTP, Auxiliar d 1ra, auxiliar de 2&ordf;da), per&iacute;odo</span></span></h2>\n</li>\n</ol></li>\n<li>\n<h2 class="western" align="JUSTIFY"><span style="color: #000000;"><span style="font-size: medium;">Para formaci&oacute;n de recursos humanos en Investigaci&oacute;n, Innovaci&oacute;n y Desarrollo </span></span></h2>\n<ol>\n<li>\n<h2 class="western" align="JUSTIFY"><span style="color: #000000;"><span style="font-size: medium;">Instituci&oacute;n &ndash; Proyecto &ndash; Apellido y Nombre del recurso humanos formado, Cargo (docente, becario) , per&iacute;odo</span></span></h2>\n</li>\n</ol></li>\n<li>\n<h2 class="western" align="JUSTIFY"><span style="color: #000000;"><span style="font-size: medium;">Para direcci&oacute;n de tesis</span></span></h2>\n<ol>\n<li>\n<h2 class="western" align="JUSTIFY"><span style="color: #000000;"><span style="font-size: medium;">Instituci&oacute;n, t&iacute;tulo de la tesis, tipo de tesina (grado, posgrado), Apellido y nombre del tesista &ndash; a&ntilde;o de aprobaci&oacute;n de la tesis.</span></span></h2>\n</li>\n</ol></li>\n</ol>', '<h2>Podr&aacute; agregar un m&aacute;ximo de 3&nbsp;(tres) antecedentes por cada &iacute;tem</h2>\n<h2>1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Proyectos &nbsp;acreditados:</h2>\n<h2>Para cada proyecto indicar: t&iacute;tulo del proyecto &ndash; rol dentro del proyecto &nbsp;- instituci&oacute;n &ndash; per&iacute;odo &ndash; c&oacute;digo de acreditaci&oacute;n del proyecto.</h2>\n<h2>2&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>Proyectos de &nbsp;no acreditados:</strong></h2>\n<h2>Para cada proyecto indicar: t&iacute;tulo del proyecto &ndash; rol dentro del proyecto&nbsp; - instituci&oacute;n &ndash; per&iacute;odo</h2>', '<h2>A continuaci&oacute;n se brinda una gu&iacute;a de carga de datos para este campo</h2>\n<ol>\n<li>&nbsp;Libros (Autor - T&iacute;tulo - Editorial - Ciudad - A&ntilde;o)</li>\n<li>&nbsp;Cap&iacute;tulos de libro&nbsp;(Autor - T&iacute;tulo - Cap&iacute;tulo/s - Editorial - Ciudad - A&ntilde;o)</li>\n<li>Publicaciones en Revistas (Autores - T&iacute;tulo - Revista - Vol. N&uacute;mero - A&ntilde;o)</li>\n<li>Publicaciones en Congresos (Autores - T&iacute;tulo - Congreso - Lugar &nbsp;Fecha)</li>\n<li>Otras publicaciones, producci&oacute;n y/o transferencia (Ej, Gu&iacute;a de trabajos pr&aacute;cticos, apuntes electr&oacute;nicos, etc. )</li>\n</ol>', NULL, 1, '<p><strong>Aclaraci&oacute;n: en cada &iacute;tem,&nbsp; priorice los antecedentes&nbsp; de acuerdo a lo que registr&oacute; en el &iacute;tem Tem&aacute;ticas de capacitaci&oacute;n a las&nbsp; que se postula.</strong></p>\n<h2>1.&nbsp;Experiencia en Organismos P&uacute;blicos CENTRALIZADOS Y DESCENTRALIZADOS (no incluir a actividades de ense&ntilde;anza) &ndash; 3 ANTECEDENTES M&Agrave;S RECIENTES</h2>\n<p>1. Organismo - Funci&oacute;n - Fecha de ingreso/egreso</p>\n<p>2. Organismo - Funci&oacute;n - Fecha de ingreso/egreso</p>\n<p>3. Organismo - Funci&oacute;n - Fecha de ingreso/egreso</p>\n<h2>2. &nbsp;Experiencia en AMBITO PRIVADO&nbsp; (no incluir a actividades de ense&ntilde;anza) &ndash; 3 ANTECEDENTES M&Agrave;S RECIENTES</h2>\n<ol>\n<li>&nbsp;&nbsp;&nbsp;&nbsp;Empresa&nbsp; - Actividad /Cargo desempe&ntilde;ado -&nbsp; Fecha de ingreso/egreso.</li>\n<li>&nbsp;&nbsp;&nbsp;&nbsp;Empresa&nbsp; - Actividad /Cargo desempe&ntilde;ado -&nbsp; Fecha de ingreso/egreso.</li>\n<li>&nbsp;&nbsp;&nbsp;&nbsp;Empresa&nbsp; - Actividad /Cargo desempe&ntilde;ado -&nbsp; Fecha de ingreso/egreso.</li>\n</ol>\n<h2>&nbsp;</h2>', NULL);
INSERT INTO `curso` (`id`, `capacitador_id`, `descripcion`, `contenido`, `modalidad`, `certificado_id`, `inscricion_abierta`) VALUES
(1, NULL, 'Con la implementación de esta acción de capacitación se pretende mejorar la comprensión de la documentación que guarda relación con las medidas en materia administración de personal con el que se rige la administración pública.', '<p>La contribuci&oacute;n es optimizar los tr&aacute;mites referentes a las situaciones de los agentes que revistan en la administraci&oacute;n p&uacute;blica, disminuyendo errores procedimentales, de fondo y de forma. Reforzar el conocimiento sobre las responsabilidades inherentes a los cargos que intervienen en la gesti&oacute;n del personal de la administraci&oacute;n p&uacute;blica.</p><p><a href="../../uploads/publicacion/967314626b25113c4e09b1392c369c71bc012e39.pdf" target="_blank">Ficha T&eacute;cnica</a></p>', 'presencial', NULL, NULL),
(2, NULL, 'Podemos afirmar que el futuro está abierto y que la luz de las posibilidades nos ofrece dos opciones: adaptarse o construir el futuro.', NULL, '', NULL, NULL),
(3, NULL, 'El curso busca analizar las ideas y concepciones sobre la autoridad -que en general, en los organismos públicos es lineal-jerárquica- para poder reconstruir el concepto de liderazgo. También analizar y reflexionar sobre los elementos que constituyen un liderazgo efectivo, para que a partir de estos, se desarrolle una propuesta contextual de liderazgo en el estado provincial.', '<p><a href="../../../uploads/publicacion/fec0da90d2b8a452403fc0440e917e3e3c61cee8.pdf" target="_blank">Ficha T&eacute;cnica</a></p>', 'presencial', NULL, NULL),
(4, NULL, 'El Taller está destinado EXCLUSIVAMENTE a los agentes de la administración pública provincial integrantes de los equipos de investigación que hayan presentado proyectos a la Convocatoria 2014.', '<p>La propuesta tiene la finalidad de brindar herramientas conceptuales y procedimentales para ser implementadas en los distintos momentos del proceso de investigaci&oacute;n. El Taller estar&aacute; a cargo de la Dra. Ana Rosa Pratesi.</p>', 'presencial', NULL, NULL),
(5, NULL, 'El curso de desarrollará en el Gabinete Informático del IPAP Chaco y estará a cargo de la Capacitadora interna Ing. Yanina Vallejos.', '<p>OBJETIVO GENERAL:<br />&bull; Brindar al alumno formaci&oacute;n avanzada de las herramientas ofim&aacute;ticas para que pueda aplicarlo en su lugar de trabajo en forma eficiente.<br />&bull; Facilitar la integraci&oacute;n de documentos y datos con casos pr&aacute;cticos que pueden ser utilizados en su &aacute;mbito laboral.</p>', 'presencial', NULL, NULL),
(6, NULL, 'El curso apunta a la comprensión de situaciones de servicio a las personas en distintas circunstancias y contextos.\r\nEl servicio de excelencia a las personas involucra acciones con el objetivo de prestar un atención personalizada y con alto desempeño, que trae aparejado una imagen positiva en las personas.', NULL, 'elearning', NULL, NULL),
(7, NULL, 'La formación en el uso de las herramientas informáticas permite al agente público a adquirir las habilidades básicas para incorporar las TICS en sus tareas diarias. Por otra parte, prepara al personal para operar en ambientes informáticos.', NULL, 'presencial', NULL, NULL),
(8, NULL, 'El objetivo del taller apunta a la comprensión y vivencia de situaciones de servicio a las personas en distintas circunstancias y contextos. El servicio de excelencia a las personas involucra acciones con el objetivo de prestar una atención personalizada y con alto desempeño, que trae aparejado una imagen positiva en las personas.', '<p><a href="../../../uploads/publicacion/59dabafce6bff9dc92cea8a275c849924d573711.pdf" target="_blank">Ficha T&eacute;cnica</a></p>', 'presencial', NULL, NULL),
(10, NULL, 'La capacitación tiene como objetivo desarrollar las habilidades pertinentes para detectar y diagnosticar las necesidades de capacitación y entrenamiento del personal de las áreas respectivas y está destinado a Directores de RRHH y Jefes de Dpto Capacitación y Carrera o cargos equivalentes.', NULL, 'presencial', NULL, NULL),
(11, NULL, 'Esta actividad responde a los objetivos de la política de gobierno de dotar a cada agente de la administración de las herramientas tecnológicas necesarias para la optimización del desempeño personal; y por ende, de cada una de las áreas en las que se insertan.', '<p><span lang="ES"><span lang="ES">&nbsp;</span></span></p><p><strong>FICHA T&Eacute;CNICA</strong></p><p><strong>&nbsp;</strong></p><p><strong>Curso: MICROSOFT WORD &ndash; NIVEL BASICO</strong></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>Capacitador: </strong></p><p><strong>&nbsp;</strong></p><p><strong>OBJETIVO GENERAL:</strong></p><p><strong>&nbsp;</strong></p><p><a name="_GoBack"></a>&nbsp;</p><p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Que el alumno comprenda los conceptos b&aacute;sicos del Programa Microsoft Word, Adquiera las herramientas para que el tratamiento de textos sea m&aacute;s eficiente, r&aacute;pido y tenga una mejor presentaci&oacute;n.</p><p>&nbsp;</p><p><strong>&nbsp;</strong></p><p><strong>REQUISITOS </strong>Conocimiento de PC.</p><p><strong>&nbsp;</strong></p><p><strong>CONTENIDOS: </strong></p><h2><a name="_Toc381810444"></a><a name="_Toc288512699"></a>MICROSOFT WORD &ndash; NIVEL BASICO</h2><p>DURACI&Oacute;N: 24 horas</p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>Unidad 1</strong>: Microsoft&nbsp; Word:</p><p>Introducci&oacute;n. Iniciar Word. La ventana de Word. Men&uacute;s desplegables. Barras de herramientas. Men&uacute;s contextuales. La barra de estado. Salir de Word. Abrir, guardar y cerrar un archivo. Tipos de vistas. Otras formas de presentaci&oacute;n.</p><p><strong>Unidad 2</strong>: Editar y Guardar documentos:</p><p>Escribir texto Seleccionar texto. Cortar, copiar, pegar. Eliminar texto. Deshacer. Salto de p&aacute;gina. Tipo de alineaciones. Distintos tipos de sangr&iacute;as.</p><p><strong>&nbsp;</strong></p><p><strong>Unidad 3</strong>: Fuente:</p><p>Tipo y tama&ntilde;o. Negrita, cursiva, subrayado. Tipos de subrayados. &Iacute;ndice. Sub&iacute;ndice. Interlineado y espaciado. Bordes y sombreados. Numeraci&oacute;n y vi&ntilde;etas. Revisi&oacute;n ortogr&aacute;fica y gramatical.</p><p><strong>&nbsp;</strong></p><p><strong>Unidad 4:</strong> Imprimir:</p><p>Preparar la p&aacute;gina: tama&ntilde;o de papel, m&aacute;rgenes. M&aacute;rgenes sim&eacute;tricos. Encuadernaci&oacute;n.&nbsp; Orientaci&oacute;n. Vista preliminar. Impresi&oacute;n. Selecci&oacute;n de impresora. Cantidad de copias. Intercalar hojas.</p><p>&nbsp;</p><p><strong>Unidad 5</strong>: Tablas:</p><p>Insertar tabla, insertar filas, columnas. Eliminar filas, columnas. Autoformato de tablas. Propiedades. Modificar una tabla.&nbsp; Dividir celdas. Combinar celdas. Ordenar. F&oacute;rmula. Dibujar tablas. Tablas anidadas.</p><p>&nbsp;</p><table><tbody><tr><td><p><strong>DURACI&Oacute;N Y CRONOGRAMA: </strong>veinticuatro(24) horas, distribuidas en diez (10) encuentros de dos horas y treinta minutos (02:30) horas reloj cada uno, d&iacute;as lunes y mi&eacute;rcoles Grupo 1; martes y jueves Grupo 5, ambos de 07:30 a 10:00</p><p>&nbsp;</p><p><strong>FECHA DE INICIO: </strong>Grupo 1 lunes 09 de junio y Grupo 5 martes 10 de junio.</p><p>&nbsp;</p><p><strong>DIAS: </strong>Lunes 9, 16, 23 y 30 de junio, 07 de julio de 2014 ; Mi&eacute;rcoles 11, 18 y 25 de junio, 2 y 16 julio de 2014 <strong>(Grupo 1)</strong>.</p><p>&nbsp;</p><p><strong>&nbsp;</strong></p><p><strong>CIERRE DE INSCRIPCI&Oacute;N:</strong> viernes 04 de junio.</p><p><strong>&nbsp;</strong></p><p><strong>CUPO ASIGNADO AL ORGANISMO: </strong>2 (dos) participantes.</p><p>&nbsp;</p><p><strong>SEDE: </strong>Extensi&oacute;n Universitaria &ndash; Universidad Tecnol&oacute;gica Nacional &ndash; Facultad Regional&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Resistencia.</p><p>&nbsp;</p></td></tr></tbody></table><p><span lang="ES"><span lang="ES"><strong>&nbsp;</strong></span></span></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p>&nbsp;</p><p><span lang="ES"><!-- [if gte mso 9]><xml> <o:OLEObject Type="Embed" ProgID="Word.Document.12" ShapeID="_x0000_i1025"  DrawAspect="Content" ObjectID="_1462689250"> </o:OLEObject></xml><![endif]--></span></p>', 'presencial', NULL, NULL),
(12, NULL, 'Esta actividad responde a los objetivos de la política de gobierno de dotar a cada agente de la administración de las herramientas tecnológicas necesarias para la optimización del desempeño personal; y por ende, de cada una de las áreas en las que se insertan.', '<p><strong>FICHA T&Eacute;CNICA</strong></p><p><strong>&nbsp;</strong></p><p><strong>Curso: MICROSOFT WORD &ndash; NIVEL BASICO</strong></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>Capacitador: </strong></p><p><strong>&nbsp;</strong></p><p><strong>OBJETIVO GENERAL:</strong></p><p><strong>&nbsp;</strong></p><p><a name="_GoBack"></a>&nbsp;</p><p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Que el alumno comprenda los conceptos b&aacute;sicos del Programa Microsoft Word, Adquiera las herramientas para que el tratamiento de textos sea m&aacute;s eficiente, r&aacute;pido y tenga una mejor presentaci&oacute;n.</p><p>&nbsp;</p><p><strong>&nbsp;</strong></p><p><strong>REQUISITOS </strong>Conocimiento de PC.</p><p><strong>&nbsp;</strong></p><p><strong>CONTENIDOS: </strong></p><h2><a name="_Toc381810444"></a><a name="_Toc288512699"></a>MICROSOFT WORD &ndash; NIVEL BASICO</h2><p>DURACI&Oacute;N: 24 horas</p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>Unidad 1</strong>: Microsoft&nbsp; Word:</p><p>Introducci&oacute;n. Iniciar Word. La ventana de Word. Men&uacute;s desplegables. Barras de herramientas. Men&uacute;s contextuales. La barra de estado. Salir de Word. Abrir, guardar y cerrar un archivo. Tipos de vistas. Otras formas de presentaci&oacute;n.</p><p><strong>Unidad 2</strong>: Editar y Guardar documentos:</p><p>Escribir texto Seleccionar texto. Cortar, copiar, pegar. Eliminar texto. Deshacer. Salto de p&aacute;gina. Tipo de alineaciones. Distintos tipos de sangr&iacute;as.</p><p><strong>&nbsp;</strong></p><p><strong>Unidad 3</strong>: Fuente:</p><p>Tipo y tama&ntilde;o. Negrita, cursiva, subrayado. Tipos de subrayados. &Iacute;ndice. Sub&iacute;ndice. Interlineado y espaciado. Bordes y sombreados. Numeraci&oacute;n y vi&ntilde;etas. Revisi&oacute;n ortogr&aacute;fica y gramatical.</p><p><strong>&nbsp;</strong></p><p><strong>Unidad 4:</strong> Imprimir:</p><p>Preparar la p&aacute;gina: tama&ntilde;o de papel, m&aacute;rgenes. M&aacute;rgenes sim&eacute;tricos. Encuadernaci&oacute;n.&nbsp; Orientaci&oacute;n. Vista preliminar. Impresi&oacute;n. Selecci&oacute;n de impresora. Cantidad de copias. Intercalar hojas.</p><p>&nbsp;</p><p><strong>Unidad 5</strong>: Tablas:</p><p>Insertar tabla, insertar filas, columnas. Eliminar filas, columnas. Autoformato de tablas. Propiedades. Modificar una tabla.&nbsp; Dividir celdas. Combinar celdas. Ordenar. F&oacute;rmula. Dibujar tablas. Tablas anidadas.</p><p>&nbsp;</p><table><tbody><tr><td><p><strong>DURACI&Oacute;N Y CRONOGRAMA: </strong>veinticuatro(24) horas, distribuidas en diez (10) encuentros de dos horas y treinta minutos (02:30) horas reloj cada uno, d&iacute;as lunes y mi&eacute;rcoles Grupo 1; martes y jueves Grupo 5, ambos de 07:30 a 10:00</p><p>&nbsp;</p><p><strong>FECHA DE INICIO: </strong>Grupo 5 martes 10 de junio.</p><p>&nbsp;</p><p><strong>DIAS:&nbsp;</strong>Martes 10, 17 y 24 de junio, 1 y 8 de julio de 2014; Jueves 12, 19 y 26 de junio, 3 y 10 de julio de 2014 <strong>(Grupo 5)</strong>.</p><p><strong>&nbsp;</strong></p><p><strong>CIERRE DE INSCRIPCI&Oacute;N:</strong> viernes 04 de junio.</p><p><strong>&nbsp;</strong></p><p><strong>CUPO ASIGNADO AL ORGANISMO: </strong>2 (dos) participantes.</p><p>&nbsp;</p><p><strong>SEDE: </strong>Extensi&oacute;n Universitaria &ndash; Universidad Tecnol&oacute;gica Nacional &ndash; Facultad Regional&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Resistencia.</p><p>&nbsp;</p></td></tr></tbody></table><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p>&nbsp;</p>', 'presencial', NULL, NULL),
(13, NULL, 'Esta actividad responde a los objetivos de la política de gobierno de dotar a cada agente de la administración de las herramientas tecnológicas necesarias para la optimización del desempeño personal; y por ende, de cada una de las áreas en las que se insertan.', '<p><strong>FICHA T&Eacute;CNICA</strong></p><p><strong>&nbsp;</strong></p><p><strong>Curso: MICROSOFT WORD &ndash; NIVEL AVANZADO</strong></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>Capacitador: </strong></p><p><strong>&nbsp;</strong></p><p><strong>OBJETIVO GENERAL:</strong></p><p><strong>&nbsp;</strong></p><p>Que el alumno interprete la necesidad de producir cartas con id&eacute;ntico contenido para enviar a distintos destinatarios. Confeccionar macros para automatizar tareas. Personalizar a sus necesidades los men&uacute;s o barras de herramientas. Establecer una relaci&oacute;n de un documento a otro, dentro del mismo documento, a una p&aacute;gina WEB, a una direcci&oacute;n de correo electr&oacute;nico.</p><p>&nbsp;</p><p><strong>&nbsp;</strong></p><p><strong>REQUISITOS </strong>Conocimiento de PC.&nbsp; Conocimientos de Word B&aacute;sico.<a name="_GoBack"></a></p><p><strong>&nbsp;</strong></p><p><strong>CONTENIDOS: </strong></p><p><strong>&nbsp;</strong></p><p><strong>MICROSOFT WORD &ndash; NIVEL AVANZADO</strong></p><p>DURACI&Oacute;N: 24 horas</p><p><strong>&nbsp;</strong></p><p><strong>Objetivo</strong>: Que el alumno interprete la necesidad de producir cartas con id&eacute;ntico contenido para enviar a distintos destinatarios. Confeccionar macros para automatizar tareas. Personalizar a sus necesidades los men&uacute;s o barras de herramientas. Establecer una relaci&oacute;n de un documento a otro, dentro del mismo documento, a una p&aacute;gina WEB, a una direcci&oacute;n de correo electr&oacute;nico.</p><p>&nbsp;</p><p><strong>Unidad 1</strong>: Encabezados, notas y pies:</p><p>Encabezados y pies. Notas al pie de p&aacute;gina. Editar notas al pie. Notas al final del documento. Modificar vi&ntilde;etas y n&uacute;meros. Listas multinivel.</p><p><strong>&nbsp;</strong></p><p><strong>Unidad 2: </strong>Columnas:</p><p>Columnas de texto. Columnas con distinto ancho. Modificar columnas. Hiperv&iacute;nculos: Insertar hiperv&iacute;nculos. Tipos de v&iacute;nculos. Modificar un hiperv&iacute;nculo. Quitar un hiperv&iacute;nculo.</p><p><strong>&nbsp;</strong></p><p><strong>Unidad 3:</strong> Combinar correspondencia y Macros:</p><p>Crear documento principal. Crear origen de datos. Combinar los datos del documento. Macro: concepto. Crear una macro. Asignaci&oacute;n de teclas. Asignaci&oacute;n de bot&oacute;n. Ejecutar macros. Eliminar una macro.</p><p><strong>Unidad 4:</strong> Elementos gr&aacute;ficos:</p><p>Cuadros de texto. Insertar im&aacute;genes. Objetos de dibujo. Autoformas.</p><p>&nbsp;</p><p><strong>Unidad 5:</strong> Personalizar men&uacute;s y barras:</p><p>Crear un nuevo men&uacute;. Personalizar un men&uacute;. Personalizar las barras. Crear una nueva barra. Restablecer las barras de herramientas.</p><p>&nbsp;</p><p>&nbsp;</p><table><tbody><tr><td><p><strong>DURACI&Oacute;N Y CRONOGRAMA: </strong>veinticuatro(24) horas, distribuidas en diez (10) encuentros de dos horas y treinta minutos (02:30) horas reloj cada uno, d&iacute;as lunes y mi&eacute;rcoles Grupo 2; martes y jueves Grupo 6, ambos de 10:00 a 12:30</p><p>&nbsp;</p><p><strong>FECHA DE INICIO: </strong>Grupo 2 lunes 09 de junio y Grupo 6 martes 10 de junio.</p><p>&nbsp;</p><p><strong>DIAS: </strong>Lunes 9, 16, 23 y 30 de junio, 07 de julio de 2014 ; Mi&eacute;rcoles 11, 18 y 25 de junio, 2 y 16 julio de 2014 <strong>(Grupo 2)</strong>.</p><p>&nbsp;</p><p><strong>CIERRE DE INSCRIPCI&Oacute;N:</strong> viernes 04 de junio.</p><p><strong>&nbsp;</strong></p><p><strong>CUPO ASIGNADO AL ORGANISMO: </strong>2 (dos) participantes.</p><p>&nbsp;</p><p><strong>SEDE: </strong>Extensi&oacute;n Universitaria &ndash; Universidad Tecnol&oacute;gica Nacional &nd