(15, NULL, 'Esta actividad responde a los objetivos de la política de gobierno de dotar a cada agente de la administración de las herramientas tecnológicas necesarias para la optimización del desempeño personal; y por ende, de cada una de las áreas en las que se insertan.', '<p><strong>FICHA T&Eacute;CNICA</strong></p><p><strong>&nbsp;</strong></p><p><strong>Curso: MICROSOFT EXCEL &ndash; NIVEL BASICO</strong></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>OBJETIVO GENERAL:</strong></p><p><strong>&nbsp;</strong></p><p>Que el alumno comprenda los conceptos b&aacute;sicos del Programa Microsoft Excel, Adquiera las conocimientos para confeccionar una planilla de c&aacute;lculo. Crear e interpretar los gr&aacute;ficos.</p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>REQUISITOS </strong>Conocimiento de PC.</p><p>&nbsp;</p><p><strong>CONTENIDOS: </strong></p><h2><a name="_Toc381810446"></a><a name="_GoBack"></a>Microsoft Excel - Nivel B&aacute;sico</h2><p>DURACI&Oacute;N: 24 horas</p><p>&nbsp;</p><p><strong>Unidad 1: </strong>Introducci&oacute;n: Introducci&oacute;n al uso de una Planilla de C&aacute;lculo. La ventana principal. Componentes. Manejo de men&uacute; e &iacute;conos. Barra de f&oacute;rmulas. El primer libro. Salir de Excel. Conceptos generales. Desplazamiento. Insertar y eliminar hojas. Mover y copiar hojas. Guardar archivos.</p><p>&nbsp;</p><p><strong>Unidad 2: </strong>Creaci&oacute;n y Administraci&oacute;n de Hojas de C&aacute;lculo: Conceptos fundamentales. Formas de introducir datos. Introducir n&uacute;meros y texto. Introducir fechas. Ingresar y modificar informaci&oacute;n: seleccionar celdas contiguas y no contiguas. Edici&oacute;n de celdas. Copiar y mover celdas. Insertar y eliminar filas y columnas. Llenado de celdas adyacentes.&nbsp; Autollenado. Administrar hojas de c&aacute;lculo. Rango.</p><p>&nbsp;</p><p><strong>Unidad 3: </strong>Formato de la planilla: formato de: n&uacute;meros, fuente,&nbsp; bordes, alineaci&oacute;n, tramas. Combinar celdas. Ajustar texto. Definir alto de la fila, ancho de columna. Colocar nombre a las hojas. Ordenar la planilla.</p><p>&nbsp;</p><p><strong>Unidad 4: </strong>F&oacute;rmulas. Sintaxis. Referencias. absoluto y relativo. Referencias a otras hojas. Mover y copiar f&oacute;rmulas. R&oacute;tulos y nombres. Trabajo con funciones. Funciones. Autosuma. Pegar funci&oacute;n. Funciones sugeridas.</p><p><strong>&nbsp;</strong></p><p><strong>Unidad 5: </strong>Creaci&oacute;n de Gr&aacute;ficos: crear un gr&aacute;fico. Distintos tipos. Interpretaci&oacute;n.&nbsp; Modificar un gr&aacute;fico. Agregar t&iacute;tulos y referencias. Modificar los valores en la planilla o en el gr&aacute;fico. Personalizar un gr&aacute;fico..</p><p><strong>&nbsp;</strong></p><p><strong>Unidad 6: </strong>Preparar la impresi&oacute;n: definir el &aacute;rea de impresi&oacute;n. Borrar el &aacute;rea de impresi&oacute;n. Establecer los m&aacute;rgenes. Encabezado y pie de p&aacute;gina. Preparaci&oacute;n de p&aacute;gina,&nbsp; Vista previa. Elecci&oacute;n de impresora. Impresi&oacute;n del trabajo.</p><p>&nbsp;</p><table><tbody><tr><td><p><strong>DURACI&Oacute;N Y CRONOGRAMA: </strong>veinticuatro(24) horas, distribuidas en diez (10) encuentros de dos horas y treinta minutos (02:30) horas reloj cada uno, d&iacute;as lunes y mi&eacute;rcoles Grupo 3 de 07:30 a 10:00</p><p>&nbsp;</p><p><strong>FECHA DE INICIO: </strong>Grupo 3 lunes 09 de junio&nbsp;</p><p>&nbsp;</p><p><strong>DIAS: </strong>Lunes 9, 16, 23 y 30 de junio, 07 de julio de 2014 ; Mi&eacute;rcoles 11, 18 y 25 de junio, 2 y 16 julio de 2014 <strong>(Grupo 3)</strong>.</p><p>&nbsp;</p><p><strong>CIERRE DE INSCRIPCI&Oacute;N:</strong> viernes 04 de junio.</p><p><strong>&nbsp;</strong></p><p><strong>CUPO ASIGNADO AL ORGANISMO: </strong>2 (dos) participantes.</p><p>&nbsp;</p><p><strong>SEDE: </strong>Extensi&oacute;n Universitaria &ndash; Universidad Tecnol&oacute;gica Nacional &ndash; Facultad Regional&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Resistencia.</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p></td></tr></tbody></table><p>&nbsp;</p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p>', 'presencial', NULL, NULL),
