(17, NULL, 'Esta actividad responde a los objetivos de la política de gobierno de dotar a cada agente de la administración de las herramientas tecnológicas necesarias para la optimización del desempeño personal; y por ende, de cada una de las áreas en las que se insertan.', '<p><strong>FICHA T&Eacute;CNICA</strong></p><p><strong>&nbsp;</strong></p><p><strong>Curso: MICROSOFT EXCEL &ndash; NIVEL AVANZADO</strong></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>Capacitador: </strong></p><p><strong>&nbsp;</strong></p><p><strong>OBJETIVO GENERAL:</strong></p><p><strong>&nbsp;</strong></p><p>Que el alumno logre dise&ntilde;ar una base de datos. Adquirir habilidades para ordenar; usar filtros. Comprender la validaci&oacute;n de los datos. Relacionar hojas y archivos de trabajo. Organizar tablas din&aacute;micas. Usar distintas funciones</p><p><strong>&nbsp;</strong></p><p><strong>REQUISITOS </strong>Conocimiento de PC. Conocimientos de Excel B&aacute;sico.</p><p><strong>&nbsp;</strong></p><p><strong>CONTENIDOS: </strong></p><h2><a name="_Toc381810447"></a>Microsoft Excel - Nivel Avanzado</h2><p>DURACI&Oacute;N: 24 horas</p><p>&nbsp;</p><p>&nbsp;</p><p><strong>Unidad 1: </strong>Dise&ntilde;ar una base de datos: Filtros: autofiltros, filtros personalizados, filtros avanzados. Subtotales. Formulario: crear una ficha de formulario. Ordenar una lista de datos. Validaci&oacute;n de datos.</p><p>&nbsp;</p><p><strong>Unidad 2:</strong> Hiperv&iacute;nculos: Concepto. Crear, modificar y eliminar hiperv&iacute;nculos. V&iacute;nculos&nbsp; dentro de un libro. V&iacute;nculos con un archivo &oacute; p&aacute;gina Web. V&iacute;nculos con direcciones electr&oacute;nicas. V&iacute;nculos con un libro nuevo. Enlace de hojas de c&aacute;lculo y libros de trabajo</p><p>&nbsp;</p><p><strong>Unidad 3:</strong> Tabla Din&aacute;mica: concepto. Funcionamiento de una tabla din&aacute;mica. Pasos para crear una tabla din&aacute;mica. Lista o base de datos de Microsoft Excel, fuente de datos externa. Rangos de consolidaci&oacute;n m&uacute;ltiples. Crear un gr&aacute;fico din&aacute;mico Modificar la tabla y el gr&aacute;fico din&aacute;mico. Personalizar la tabla&nbsp; din&aacute;mica, dar formato y editar una tabla din&aacute;mica.</p><p>&nbsp;</p><p><strong>Unidad 4<a name="_GoBack"></a>:</strong> Macros: concepto de macro. Crear una macro mediante: asignaci&oacute;n de &iacute;conos y de teclas, para automatizar tareas. Ejecutar una macro. Eliminar una macro.</p><table><tbody><tr><td><p><strong>DURACI&Oacute;N Y CRONOGRAMA: </strong>veinticuatro(24) horas, distribuidas en diez (10) encuentros de dos horas y treinta minutos (02:30) horas reloj cada uno, d&iacute;as lunes y mi&eacute;rcoles Grupo 4; de 10:00 a 12:30</p><p>&nbsp;</p><p><strong>FECHA DE INICIO: </strong>Grupo 4 lunes 09 de junio .</p><p>&nbsp;</p><p><strong>DIAS: </strong>Lunes 9, 16, 23 y 30 de junio, 07 de julio de 2014 ; Mi&eacute;rcoles 11, 18 y 25 de junio, 2 y 16 julio de 2014 <strong>(Grupo 4)</strong>.</p><p>&nbsp;</p><p><strong>&nbsp;</strong></p><p><strong>CIERRE DE INSCRIPCI&Oacute;N:</strong> viernes 04 de junio.</p><p><strong>&nbsp;</strong></p><p><strong>CUPO ASIGNADO AL ORGANISMO: </strong>2 (dos) participantes.</p><p>&nbsp;</p><p><strong>SEDE: </strong>Extensi&oacute;n Universitaria &ndash; Universidad Tecnol&oacute;gica Nacional &ndash; Facultad Regional&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Resistencia.</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p><strong>SEDE:</strong> Direcci&oacute;n&nbsp; de Capacitaci&oacute;n &ndash; Arturo Illia 26 &ndash; Edificio Olivetti &ndash; Planta baja.</p><p>&nbsp;</p></td></tr></tbody></table><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p>', 'presencial', NULL, NULL),
(18, NULL, 'Esta actividad responde a los objetivos de la política de gobierno de dotar a cada agente de la administración de las herramientas tecnológicas necesarias para la optimización del desempeño personal; y por ende, de cada una de las áreas en las que se insertan.', '<p><strong>FICHA T&Eacute;CNICA</strong></p><p><strong>&nbsp;</strong></p><p><strong>Curso: MICROSOFT EXCEL &ndash; NIVEL AVANZADO</strong></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>Capacitador: </strong></p><p><strong>&nbsp;</strong></p><p><strong>OBJETIVO GENERAL:</strong></p><p><strong>&nbsp;</strong></p><p>Que el alumno logre dise&ntilde;ar una base de datos. Adquirir habilidades para ordenar; usar filtros. Comprender la validaci&oacute;n de los datos. Relacionar hojas y archivos de trabajo. Organizar tablas din&aacute;micas. Usar distintas funciones</p><p><strong>&nbsp;</strong></p><p><strong>REQUISITOS </strong>Conocimiento de PC. Conocimientos de Excel B&aacute;sico.</p><p><strong>&nbsp;</strong></p><p><strong>CONTENIDOS: </strong></p><h2><a name="_Toc381810447"></a>Microsoft Excel - Nivel Avanzado</h2><p>DURACI&Oacute;N: 24 horas</p><p>&nbsp;</p><p>&nbsp;</p><p><strong>Unidad 1: </strong>Dise&ntilde;ar una base de datos: Filtros: autofiltros, filtros personalizados, filtros avanzados. Subtotales. Formulario: crear una ficha de formulario. Ordenar una lista de datos. Validaci&oacute;n de datos.</p><p>&nbsp;</p><p><strong>Unidad 2:</strong> Hiperv&iacute;nculos: Concepto. Crear, modificar y eliminar hiperv&iacute;nculos. V&iacute;nculos&nbsp; dentro de un libro. V&iacute;nculos con un archivo &oacute; p&aacute;gina Web. V&iacute;nculos con direcciones electr&oacute;nicas. V&iacute;nculos con un libro nuevo. Enlace de hojas de c&aacute;lculo y libros de trabajo</p><p>&nbsp;</p><p><strong>Unidad 3:</strong> Tabla Din&aacute;mica: concepto. Funcionamiento de una tabla din&aacute;mica. Pasos para crear una tabla din&aacute;mica. Lista o base de datos de Microsoft Excel, fuente de datos externa. Rangos de consolidaci&oacute;n m&uacute;ltiples. Crear un gr&aacute;fico din&aacute;mico Modificar la tabla y el gr&aacute;fico din&aacute;mico. Personalizar la tabla&nbsp; din&aacute;mica, dar formato y editar una tabla din&aacute;mica.</p><p>&nbsp;</p><p><strong>Unidad 4<a name="_GoBack"></a>:</strong> Macros: concepto de macro. Crear una macro mediante: asignaci&oacute;n de &iacute;conos y de teclas, para automatizar tareas. Ejecutar una macro. Eliminar una macro.</p><table><tbody><tr><td><p><strong>DURACI&Oacute;N Y CRONOGRAMA: </strong>veinticuatro(24) horas, distribuidas en diez (10) encuentros de dos horas y treinta minutos (02:30) horas reloj cada uno, &nbsp;martes y jueves Grupo 8, de 10:00 a 12:30</p><p>&nbsp;</p><p><strong>FECHA DE INICIO: </strong>&nbsp;Grupo 8 martes 10 de junio.</p><p>&nbsp;</p><p><strong>DIAS:&nbsp;</strong>Martes 10, 17 y 24 de junio, 1 y 8 de julio de 2014; Jueves 12, 19 y 26 de junio, 3 y 10 de julio de 2014 <strong>(Grupo 8)</strong>.</p><p><strong>&nbsp;</strong></p><p><strong>CIERRE DE INSCRIPCI&Oacute;N:</strong> viernes 04 de junio.</p><p><strong>&nbsp;</strong></p><p><strong>CUPO ASIGNADO AL ORGANISMO: </strong>2 (dos) participantes.</p><p>&nbsp;</p><p><strong>SEDE: </strong>Extensi&oacute;n Universitaria &ndash; Universidad Tecnol&oacute;gica Nacional &ndash; Facultad Regional&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Resistencia.</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p><strong>SEDE:</strong> Direcci&oacute;n&nbsp; de Capacitaci&oacute;n &ndash; Arturo Illia 26 &ndash; Edificio Olivetti &ndash; Planta baja.</p><p>&nbsp;</p></td></tr></tbody></table><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p><p><strong>&nbsp;</strong></p>', 'presencial', NULL, NULL),
(19, NULL, 'Con este curso se apunta a fortalecer tanto el desarrollo de las capacidades técnicas como las aptitudes y actitudes del personal de la administración, mejorando y fortaleciendo las áreas de desempeño. Es importante que se respete el perfil de participante, pues de ello dependerá el aprovechamiento integral de capacitación.\r\nConsideramos importante destacar que esta actividad será realizada por un capacitador interno que desde el organismo en el cual se desempeña como funcionario ha accedido a transferir sus conocimientos.', '<p><strong>Curso: Ley N&ordm; 4787 &ldquo;Organizaci&oacute;n y funcionamiento de la Administraci&oacute;n Financiera &ndash; Introducci&oacute;n a la Administraci&oacute;n Financiera. Sistema de Contrataciones. Nivel B&aacute;sico.</strong></p><p><strong>&nbsp;</strong></p><p><strong>CAPACITADORA: Cra. Mar&iacute;a Rosal&iacute;a Dimitroff</strong></p><p><strong>&nbsp;</strong></p><p><strong>FUNDAMENTACI&Oacute;N</strong></p><p>Los servicios p&uacute;blicos se instrumentan a trav&eacute;s de actos, los cuales se orientan hacia el mejor aprovechamiento de los recursos humanos, materiales, financieros y t&eacute;cnicos del estado y hacia el cumplimiento de los objetivos institucionales, considerando que la creatividad, el conocimiento, los factores cognitivos y la informaci&oacute;n del recurso humano conforman el mayor activo del Estado. Por lo que es necesario concientizar en el mismo sobre la necesidad de gestionar los procesos para garantizar los principios de regularidad, legalidad, economicidad, eficiencia y eficacia en el uso de los recursos p&uacute;blicos mediante la aplicaci&oacute;n de diferentes herramientas que permitan el logro de los objetivos y la medici&oacute;n de los resultados logrados.</p><p>&nbsp;</p><p><strong>CONTRIBUCI&Oacute;N ESPERADA</strong></p><p>Proveer a los actores que participan en el proceso de administraci&oacute;n financiera gubernamental&nbsp; herramientas y una perspectiva amplia del &aacute;mbito dentro del cual desarrollan su actividad habitual, posibilitando mayor autonom&iacute;a, posibilidad de acci&oacute;n y responsabilidades las que son condiciones necesarias para el &eacute;xito de dicho proceso.</p><p>&nbsp;</p><p><strong>DESTINATARIOS</strong></p><p>Personal de de la Administraci&oacute;n P&uacute;blica Provincial con funciones inherentes a esta tem&aacute;tica o que desean ampliar sus conocimientos sobre las mismas.</p><p><strong>&nbsp;</strong></p><p><strong>OBJETIVOS</strong></p><p>Proporcionar conocimiento sobre el marco legal dentro del cual opera la administraci&oacute;n financiera gubernamental proporcionando el sustento conceptual adecuado, especialmente referido al Sistema de Contrataciones del Estado Provincial.</p><p>&nbsp;</p><p><strong>CONTENIDOS</strong></p><p>Ley N&ordm; 4787 &ldquo;Organizaci&oacute;n y funcionamiento Administraci&oacute;n Financiera Sector P&uacute;blico Provincial&rdquo;.</p><table><tbody><tr><td><p><strong>&nbsp;</strong></p><p><strong>DURACI&Oacute;N Y CRONOGRAMA: </strong>doce (12) horas, distribuidas en&nbsp; cuatro (4) encuentros de tres (3) horas reloj cada uno, d&iacute;as martes y jueves, de 17:00 a 20:00</p><p>&nbsp;</p><p><strong>FECHA DE INICIO: </strong>martes 10 de junio.</p><p>&nbsp;</p><p><strong>DIAS: </strong>Martes 10, jueves 12, martes 17 y jueves 19 de junio de 2014.</p><p><strong>&nbsp;</strong></p><p><strong>CIERRE DE INSCRIPCI&Oacute;N:</strong> viernes 06 de junio.</p><p><strong>&nbsp;</strong></p><p><strong>CUPO ASIGNADO AL ORGANISMO: </strong>cuatro (4) participantes.</p><p>&nbsp;</p><p><strong>SEDE:</strong> Direcci&oacute;n&nbsp; de Capacitaci&oacute;n &ndash; Arturo Illia 26 &ndash; Edificio Olivetti &ndash; Planta baja.</p><p>&nbsp;</p><p>&nbsp;</p><p><strong>&nbsp;</strong></p></td></tr></tbody></table>', 'presencial', NULL, NULL),
(20, NULL, 'El Taller busca que los cursantes puedan adquirir competencias y buenas prácticas en el conjunto de procesos y procedimientos definidos para la gestión de bienes del Estado en el marco de la normativa que rigen las distintas etapas de la vida útil del bien.', NULL, 'presencial', NULL, NULL),
(21, NULL, 'El próximo miércoles 18 de junio inicia un nuevo grupo del Curso en la modalidad virtual: LIDERAZGO EN ACCIÓN que estará a cargo del Mag. Cristian Marenco.', '<p><a href="../../uploads/publicacion/c850f7b15c064833961fdf3cd3a9708154abeda1.pdf" target="_blank">Ficha t&eacute;cnica</a></p>', 'elearning', NULL, NULL);
