INSERT INTO `evento` (`id`, `descripcion`, `contenido`, `inscricion_abierta`) VALUES
(30, 'Se abrió el registro provincial de capacitadores IPAP Chaco', '<p><a href="../../capacitador/inscripcion">Formulario</a></p>', NULL),
(56, 'El 5 de Diciembre de 2014 se realizó el primer Encuentro regional que contó con Conferencias y talleres a cargo del Archivo General de la Nación, la Biblioteca Nacional de Maestros, el Instituto Nacional de Administración Pública y la participación de expositores destacados del NEA. El lema: “Calidad, Nuevas Tecnologías y Gestión del Conocimiento en el manejo de la documentación en las organizaciones del Estado”. La actividad se llevó a cabo en el salón de conferencias del Colegio de Escribanos (Resistencia-Chaco).', '<div class="controls"><h4 style="text-align: justify;">El&nbsp;5 de Diciembre de 2014 se realiz&oacute; el primer Encuentro regional que cont&oacute; con&nbsp;Conferencias y talleres a cargo del Archivo General de la Naci&oacute;n, la Biblioteca Nacional de Maestros, el Instituto Nacional de Administraci&oacute;n P&uacute;blica y la participaci&oacute;n de expositores destacados del NEA. El lema: &ldquo;Calidad, Nuevas Tecnolog&iacute;as y Gesti&oacute;n del Conocimiento en el manejo de la documentaci&oacute;n en las organizaciones del Estado&rdquo;. La actividad se llev&oacute; a cabo en el sal&oacute;n de conferencias del Colegio de Escribanos (Resistencia-Chaco).</h4><p>&nbsp;Los <strong>objetivos</strong> del Encuentro fueron:</p><ul style="list-style-type: undefined;"><li>Exponer casos de &eacute;xito y buenas pr&aacute;cticas de archivolog&iacute;a y gesti&oacute;n documental aplicada al Estado utilizando las nuevas tecnolog&iacute;as y herramientas de calidad.</li><li>Generar un foro de discusi&oacute;n sobre nuevas tendencias para el manejo y la administraci&oacute;n de la documentaci&oacute;n y los archivos en el Estado.</li><li>Implementar una red de intercambio de documentaci&oacute;n e informaci&oacute;n sobre administraci&oacute;n p&uacute;blica a nivel regional.</li></ul><p><strong>&Aacute;reas tem&aacute;ticas</strong>:</p><ul style="list-style-type: undefined;"><li>Casos de &eacute;xito y recomendaciones en el tratamiento de los archivos como &ldquo;fuentes de conocimiento&rdquo;</li><li>Tecnolog&iacute;a aplicada a la gesti&oacute;n documental del Estado</li><li>Nuevas tendencias de archivolog&iacute;a</li><li>Redes de coordinaci&oacute;n e intercambio de&nbsp; informaci&oacute;n en gesti&oacute;n documental</li></ul><p style="text-align: left;">&nbsp;</p><p><a href="../../../documentos/certificados/index.htm">Descargar certificados de asistencia</a></p><p>Ver presentaciones de los expositores</p><p><a href="https://www.facebook.com/media/set/?set=a.731340683626681.1073741835.556720111088740&amp;type=1">Ver galer&iacute;a fotogr&aacute;fica del Encuentro</a></p><p><a href="../../../uploads/publicacion/73fd8e49d272ee2f8268f9a627cf80f982bd37bf.pdf">Programa del Encuentro</a></p></div>', NULL),
(65, 'El Acto de Cierre Anual de Actividades -Ciclo 2014- del IPAP Chaco se realizará el viernes 5 de diciembre, a las 19.30hs en el Salón de Conferencias del Colegio de Escribanos, sito en H. Irigoyen 469, Resistencia -Chaco.', NULL, NULL),
(67, 'El  19 de marzo a las 9 hs. en el Salón Auditorio de Casa de las Culturas se realizará la Conferencia “La Formación de Directivos para la Gestión del Conocimiento en las Organizaciones Públicas”, a cargo de la Esp. Arq. Graciela Falivene (agente gubernamental y docente de la Universidad de Concepción del Uruguay) en el marco del Acto de Apertura Ciclo de Actividades 2015 del IPAP Chaco.', '<p>La actividad est&aacute; orientada a Directores Generales, Directores, Jefes de Departamentos, Responsables de Programas o Proyectos de las jurisdicciones y p&uacute;blico interesado en la tem&aacute;tica.</p><p>La Conferencia tendr&aacute; un enfoque pr&aacute;ctico y participativo que otorgar&aacute; herramientas espec&iacute;ficas a los responsables de las distintas &aacute;reas para una mayor eficiencia en su tarea como servidor p&uacute;blico.</p><p>Para participar de la conferencia los interesados deber&aacute;n pre-inscribirse&nbsp;</p><p>&nbsp;</p><p><em><strong>ATENCI&Oacute;N: Quienes no se han pre-inscripto podr&aacute;n dirigirse&nbsp;directamente el d&iacute;a del evento a la Casa de las Cuturas&nbsp;para acreditarse y participar de la conferencia.</strong></em></p><p><em><strong>D&iacute;a&nbsp;19 de marzo,&nbsp;9hs. Casa de las Culturas</strong></em></p><p>&nbsp;</p>', NULL),
(75, 'El jueves 30 a las 08:00 hs haremos una reunión informativa para explicar el alcance del taller y los resultados en investigación que se pretenden del mismo. Se explicará también cómo es el proceso de acreditación y los requisitos, en base a la normativa, de los proyectos 2015.', NULL, NULL),
(76, 'Toda la información sobre la acreditación de las investigaciones 2015 bajo la Modalidad Ideas Proyecto', '<h4><strong>Objeto</strong>: Promover la investigaci&oacute;n aplicada para resolver problemas en los organismos del Poder Ejecutivo, centralizados, descentralizados y aut&aacute;rquicos.</h4><p><strong>Destinatarios</strong>: Agentes de la Administraci&oacute;n P&uacute;blica Provincial que deseen resolver problemas, en base a metodolog&iacute;as de investigaci&oacute;n, en sus jurisdicciones u &oacute;rganos del Estado.</p><p>Se aceptar&aacute;n Proyectos de Investigaci&oacute;n que, por su tem&aacute;tica y calidad, est&eacute;n relacionados al Plan Quinquenal de Desarrollo 2013-2017 y tengan los siguientes alcances:</p><ul><li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Realizar estudios para diagnosticar el Estado y proponer acciones que garanticen su desarrollo.</li><li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Desarrollar propuestas que contribuyan a la innovaci&oacute;n de los modelos de gesti&oacute;n.</li><li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Resolver problemas espec&iacute;ficos en diversas jurisdicciones a trav&eacute;s de:</li></ul><p>-&nbsp;&nbsp; Mejora de procesos e intercomunicaci&oacute;n entre &aacute;reas.</p><p>-&nbsp;&nbsp; Innovaci&oacute;n y modernizaci&oacute;n de la gesti&oacute;n p&uacute;blica.</p><p>-&nbsp;&nbsp; Incorporaci&oacute;n de t&eacute;cnicas de mejora continua y gesti&oacute;n hacia la calidad.</p><p>-&nbsp;&nbsp; Desarrollo de modelos o productos para perfeccionar el servicio prestado a la ciudadan&iacute;a y/o a otros organismos.</p><ul><li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Resolver problemas mediante estudios estad&iacute;sticos y t&eacute;cnicos que contribuyan a agilizar la toma de decisi&oacute;n.</li></ul><p><strong>Per&iacute;odo de la convocatoria:</strong></p><p><strong>19 de Marzo:</strong>&nbsp;Apertura de la Convocatoria y difusi&oacute;n de la misma.</p><p><strong>20 de Marzo hasta el 29 de Mayo:</strong>&nbsp;Per&iacute;odo de asistencia y soporte del equipo de IPAP para la presentaci&oacute;n de Ideas Proyectos a los investigadores de diversas jurisdicciones.</p><p><strong>05 de Junio:</strong>&nbsp;Fecha l&iacute;mite para presentar la Idea Proyecto de acuerdo a la Resoluci&oacute;n IPAP Chaco IPAP N&ordm; 13/15 con el aval del funcionario de la jurisdicci&oacute;n por Mesa de Entradas hasta las 13hs.</p><p><strong>12 de Junio:</strong>&nbsp;Publicaci&oacute;n de los resultados por los evaluadores de las propuestas.</p><p><strong>23 de Junio:</strong>&nbsp;Comienza curso de Metodolog&iacute;a de la Investigaci&oacute;n orientado hacia la descripci&oacute;n del Problema, la definici&oacute;n de los Objetivos, marco te&oacute;rico, la determinaci&oacute;n de los resultados del proyecto y el impacto esperado.</p><p><strong>14 de Septiembre:</strong>&nbsp;Entrega de Proyecto Definitivos de acuerdo a la Resoluci&oacute;n IPAP Chaco N&ordm; 99/13.</p><p>&nbsp;</p><p><strong>Asesor&iacute;a y capacitaci&oacute;n</strong></p><p>El equipo t&eacute;cnico del IPAP brindar&aacute; asesor&iacute;as en la redacci&oacute;n de los proyectos, como as&iacute; tambi&eacute;n soporte en los avances que necesiten los diferentes equipos de investigaci&oacute;n.</p><p>Adem&aacute;s se capacitar&aacute; a los integrantes de proyectos seleccionados en metodolog&iacute;a de la investigaci&oacute;n con profesionales del &aacute;rea.</p><p>&nbsp;</p><p><strong>Acreditaci&oacute;n</strong></p><p>Cada Proyecto de Investigaci&oacute;n est&aacute; enmarcado en el sistema de cr&eacute;ditos para Empleados P&uacute;blicos enunciados en el Decreto Provincial N&ordm; 512/13.</p><p>El proyecto definitivo ser&aacute; evaluadoseg&uacute;n lo establecido en laResoluci&oacute;n IPAP Chaco N&deg;99/2013 R&eacute;gimen de acreditaci&oacute;n de Proyectos de Investigaci&oacute;n IPAP.</p><p>&nbsp;</p><p><strong>Consultas</strong></p><p>En forma personal: en el horario de 08:00 a 12:00 hs en la sede del IPAP ubicada en &nbsp;Arturo Illia 26 Planta Baja &ndash; Edificio Olivetti.</p><p>Telef&oacute;nicamente al N&deg; 3624-453723</p><p>&nbsp;</p><p><a href="../../uploads/publicacion/9552088f68f2f163a3d628536849dab44dfbc5bd.pdf">Resoluci&oacute;n de Acreditaci&oacute;n&nbsp;</a></p><p><a href="../../uploads/publicacion/7cad2895bbb2cac0cb84a6bc430e7c092e332ef9.pdf">Resoluci&oacute;n Llamado a presentaci&oacute;n de IDEAS</a></p><p>&nbsp;</p><h3><strong>Solicite a ipap.investigacion@gmail.com los formularios en formato word</strong></h3>', NULL),
(78, 'El martes 21 se realizó, con gran concurrencia, una charla informativa sobre la Convocatoria a la Presentación de Ideas Proyecto 2015, donde se explicó la normativa vigente y los requisitos necesarios para desarrollar una investigación en el ámbito del Instituto en el mismo los participantes expresaron sus inquietudes y posibles temas de investigación.\r\nParticiparon 24 agentes provinciales interesados en la temática que desarrollan sus actividades en los Ministerios de Planificación, de Desarrollo Social, de Infraestructura, de Producción, de Educación, Salud y de Industria como así también del Instituto de Cultura, Lotería Chaqueña, Policía de la Provincia, Contaduría General y APA. \r\nRECORDAMOS: “Taller para la confección de ideas de Proyectos”- INICIO 5 DE MAYO A LAS 08:00HS.', NULL, NULL),
(89, 'Con la participación de destacados expositores nacionales y regionales.', '<h1 style="text-align: center;"><img style="display: block; margin-left: auto; margin-right: auto;" src="http://conie.chaco.gov.ar/images/prospectiva-banner-web.jpg" alt="2" width="636" height="181" /></h1><p>&nbsp;</p><h4 style="text-align: center;"><a href="https://eventioz.com.ar/jornada-prospectiva%20">CONFERENCIAS ABIERTAS</a>&nbsp;</h4><h4 style="text-align: center;"><a href="https://eventioz.com.ar/jornada-prospectiva%20">INSCRIBIRSE AQU&Iacute;</a></h4><p style="text-align: center;"><strong>HORARIO DE 8&nbsp;a 13.15hs</strong></p><p style="text-align: center;">Las conferencias de la jornada son abiertas al p&uacute;blico interesado en la tem&aacute;tica</p><p><strong>Tem&aacute;ticas:</strong></p><ul><li>LA PROSPECTIVA EN EL ESTADO: PRESENTE&nbsp; Y&nbsp; FUTURO</li><li>PROSPECTIVA TECNOL&Oacute;GICA</li><li>PROSPECTIVA AMBIENTAL</li><li>PROSPECTIVA REGIONAL</li><li>PROSPECTIVA NACIONAL</li></ul><p style="text-align: center;">&nbsp;</p><p style="text-align: left;"><em><strong>ACLARACI&Oacute;N:</strong>&nbsp;esta inscripci&oacute;n le permite&nbsp;participar durante la ma&ntilde;ana (de 8 a 13.15hs) en las conferencias abiertas. Si cumple con el perfil para participar del TALLER&nbsp;que se realizar&aacute; de 15.30 a 19hs, debe <a href="../../../evento/taller-anticipaci-n-estrat-gica-y-prospectiva-en-el-estado-moderno-03Sep15">INGRESAR AQU&Iacute;</a>&nbsp;para inscribirse. &nbsp;</em></p><h4 style="text-align: center;"><a href="http://conie.chaco.gov.ar/images/prospectiva-02.jpg">DESCARGAR PROGRAMA COMPLETO</a> &nbsp;</h4><p><img style="display: block; margin-left: auto; margin-right: auto;" src="http://conie.chaco.gov.ar/images/prospectiva-02.jpg" alt="" width="982" height="687" /></p>', 0),
(92, 'Dictado por el Mgter. Eduardo R. BALBI', '<h4 style="text-align: center;"><a href="https://eventioz.com.ar/taller-prospectiva%20">TALLER &ldquo;ANTICIPACI&Oacute;N ESTRAT&Eacute;GICA Y PROSPECTIVA EN EL ESTADO MODERNO&rdquo;</a></h4><h4 style="text-align: center;">&nbsp;<a href="https://eventioz.com.ar/taller-prospectiva%20">INSCRIBIRSE AQU&Iacute;</a></h4><p style="text-align: center;"><strong>HORARIO DE&nbsp;15.30 a 19hs</strong></p><h5 style="text-align: center;"><strong>(los cupos son limitados)</strong></h5><h5><strong><em>&nbsp;</em></strong></h5><p>El taller ser&aacute; dictado por el<strong>&nbsp;Mgter. Eduardo R. BALBI&nbsp;</strong>y se encuentra destinado a:</p><ul><li>Cuadros pol&iacute;ticos</li><li>Mandos superiores&nbsp; y medios de la Administraci&oacute;n P&uacute;blica Central y de organismos descentralizados y aut&aacute;rquicos del Poder Ejecutivo Provincial</li><li>Directivos, Gerentes y Jefes de las empresas del Estado.</li><li>Planificadores, asesores y consultores de las jurisdicciones del Estado Provincial</li></ul><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp; &nbsp;<a href="http://conie.chaco.gov.ar/images/prospectiva-02.jpg"><strong>PROGRAMA COMPLETO DE CONFERENCIAS Y TALLER</strong></a></p><p>&nbsp;&nbsp;<strong><img src="http://conie.chaco.gov.ar/images/prospectiva-02.jpg" alt="1" width="767" height="536" /></strong></p><p>&nbsp;</p>', 0),
(93, 'CAPACITADOR: Abog. Daniela Patricia Cantalupi (Especialista en Ingeniería en Calidad – Universidad Tecnológica Nacional- Sucursal Resistencia) (Especialista en Derecho de Familia Universidad Nacional de Rosario y por la UBA de Buenos Aires) (Maestría en Derecho Ambiental y Tutela del Patrimonio Cultural con tesis en trámite por Universidad Nacional del litoral de Santa Fe).\r\nDESTINATARIOS: Agentes de la administración pública con tareas sobre gestión de expedientes, confección de proyectos de actos administrativos y asesoría.', '<p style="text-align: center;"><strong>IMPORTANTE</strong></p><p><strong>INSCRIPCI&Oacute;N:</strong> Para participar deber&aacute; pre-inscribirse en nuestra web ipap.chaco.gov.ar y presentar a la brevedad el formulario de inscripci&oacute;n impreso con la autorizaci&oacute;n del jefe para asistir al curso.</p><p>La pre-inscripci&oacute;n y presentaci&oacute;n del formulario finaliza el 14 de SEPTIEMBRE o una vez cubierto el cupo previsto para el curso. (Se informar&aacute; en nuestra p&aacute;gina web ipap.chaco.gov.ar si se completara el cupo antes de la fecha consignada anteriormente).</p><p>INICIO: Martes 15/09 a las 17 HS.</p><p>FINALIZA: Martes 13/10</p><p><a href="../../../uploads/publicacion/791a3f4ac2142b1e8e1dff13d1c96cfbce77036f.pdf">Ficha T&eacute;cnica</a></p><p><a href="../../../uploads/publicacion/85561363719e811679e5bb01cfe8a72cff1b43d0.pdf">Formulario de Inscripci&oacute;n</a></p>', 0),
(149, 'DESTINATARIOS, INSCRIPCIÓN Y ADMISIÓN: Dirigido al personal y profesionales de diferentes Organismos de la Administración Pública, que tengan\r\ncontacto directo de atención al público o cuya función implique transmitir información, asesoramiento, contención u orientación al ciudadano.', '<div><div><strong>CURSO "LENGUA DE SE&Ntilde;AS-NIVEL I y II"</strong></div><div>&nbsp;</div><div>&nbsp;</div><div><div>Tendr&aacute;n&nbsp;<strong>prioridad en la inscripci&oacute;n</strong>&nbsp;el personal con funciones operativas espec&iacute;ficas en los&nbsp;servicios esenciales, cr&iacute;ticos y de emergencia de los siguientes organismos y oficinas de:</div><div><br />- Polic&iacute;a de la provincia del Chaco<br />- Ministerio de Desarrollo Social<br />- Ministerio de Salud P&uacute;blica<br />- Oficinas de atenci&oacute;n al p&uacute;blico de las jurisdicciones<br />- Centro de Gesti&oacute;n de Casa de Gobierno<br />- Mesas de entradas de las jurisdicciones</div><div><br />Por ser esta actividad de larga duraci&oacute;n y por su especificidad se detalla a continuaci&oacute;n los&nbsp;<strong>requisitos de&nbsp;</strong><strong>inscripci&oacute;n y admisi&oacute;n.</strong></div><div><br />1) Completar y firmar el formulario de inscripci&oacute;n &nbsp;y compromiso de cursado por parte del agente participante y su jefe inmediato.</div><div>2) Presentar el formulario antes mencionado &nbsp;en la sede de IPAP Chaco hasta las 13hs. del viernes 5 de agosto.<br />3) La solicitudes ser&aacute;n analizadas por IPAP Chaco y podr&aacute;n los aspirantes ser&nbsp;<strong>entrevistados</strong><br />telef&oacute;nicamente.<br />4) IPAP Chaco notificar&aacute; la admisi&oacute;n al curso a trav&eacute;s del correo electr&oacute;nico consignado en<br />formulario de inscripci&oacute;n.</div><div>&nbsp;</div></div><h4><strong>Descargar:&nbsp;<a href="../../uploads/publicacion/e5c7e064b89c8eea89664478ff54f87b150f2792.pdf" target="_blank">contenidos y cronograma aqu&iacute;</a></strong></h4><h4><strong>Descargar:&nbsp;<a href="../../uploads/publicacion/447c5d07fef8e5e1358e22c884469d622a12101e.pdf" target="_blank">Formulario de inscripci&oacute;n y compromiso-Lengua de Se&ntilde;as</a></strong></h4><div style="text-align: center;">Debido a las caracter&iacute;sticas del cursado y perfil de los destinatarios de los cursos, ante cualquier duda, puede contactarse con IPAP a trav&eacute;s de&nbsp;<a href="mailto:ipapchaco@gmail.com">ipapchaco@gmail.com</a>&nbsp;, Tel&eacute;fono: 4453723</div></div>', 0),
(150, 'DESTINATARIOS, INSCRIPCIÓN Y ADMISIÓN: El curso está dirigido a todas aquellas personas con funciones formales en la definición, construcción, administración o mantenimiento de sitios Web del Gobierno del Chaco, con conocimientos de herramientas y lenguajes de desarrollo WEB.', '<div><strong>CURSO "ACCESIBILIDAD WEB"&nbsp;</strong></div><div>&nbsp;</div><div><strong>DESTINATARIOS, INSCRIPCI&Oacute;N Y ADMISI&Oacute;N: </strong>Perfil del destinatario:</div><div>&nbsp;</div><div>-Desarrollador y/o Programador de aplicaciones<br />-Desarrollador de p&aacute;ginas WEB</div><div>-Dise&ntilde;adores gr&aacute;ficos</div><div>&nbsp;</div><div>Por la especificidad de la actividad se detalla a continuaci&oacute;n los requisitos de&nbsp;<strong>inscripci&oacute;n y admisi&oacute;n:</strong><br />1)&nbsp;Completar y firmar el formulario de inscripci&oacute;n &nbsp;y compromiso de cursado por parte del agente participante y su jefe inmediato.<br />2) Presentar el formulario antes mencionado &nbsp;en la sede de IPAP Chaco&nbsp;hasta las 13hs el jueves 4 de agosto a las 13hs<br />3) La solicitudes ser&aacute;n analizadas por IPAP Chaco y podr&aacute;n los aspirantes ser<strong>&nbsp;entrevistados</strong>&nbsp;telef&oacute;nicamente.<br />4)&nbsp;IPAP Chaco notificar&aacute; la admisi&oacute;n al curso a trav&eacute;s del correo electr&oacute;nico consignado en formulario de inscripci&oacute;n.</div><div>&nbsp;</div><div>&nbsp;</div><h4><strong>&nbsp;Descargar:&nbsp;<a href="../../../uploads/publicacion/7b2015c24d991f76e3a5abdc4b41524020475f76.pdf" target="_blank">contenidos y cronograma aqu&iacute;</a>&nbsp;</strong></h4><h4><strong>Descargar:&nbsp;<a href="../../uploads/publicacion/7e3d601a45d00abfd44451d174cbc3bb13a7b6e5.pdf" target="_blank">Formulario de inscripci&oacute;n y compromiso-Accesibilidad Web</a></strong></h4><h4>&nbsp;</h4><div>&nbsp;</div><div><strong>INFORMES&nbsp;</strong></div><div><div><strong>&nbsp;</strong></div><div>Debido a las caracter&iacute;sticas del cursado y perfil de los destinatarios de los cursos, ante cualquier duda, puede contactarse con IPAP a trav&eacute;s de&nbsp;<a href="mailto:ipapchaco@gmail.com">ipapchaco@gmail.com</a>&nbsp;, Tel&eacute;fono: 4453723</div></div>', 0),
(190, 'Convocatoria con destinatarios específicos', '<p style="text-align: center;"><strong>CURSO &ldquo;FORMACI&Oacute;N EN TRASTORNOS RELACIONADOS CON SUSTANCIAS PSICOACTIVAS&rdquo;</strong></p><p style="text-align: center;"><strong>&nbsp;Localidad de Villa &Aacute;ngela</strong></p><p style="text-align: center;">&nbsp;</p><p><strong>ACLARACI&Oacute;N:</strong> Se habilit&oacute; este formulario de inscripci&oacute;n para aquellas <strong>personas/instituciones que fueron invitadas</strong> por el equipo organizador integrante de la Unidad de Enlace de Consumo Problem&aacute;tico.</p><p>Por consultas sobre contenido, cronograma e inscripci&oacute;n comunicarse con IPAP Chaco a los siguientes medios:</p><p>Tel&eacute;fono: (+54) 362-4453723<br /> E-mail:&nbsp;<a href="mailto:ipapchaco@gmail.com">ipapchaco@gmail.com</a></p><p>Por otras consultas comunicarse con Consumo Problem&aacute;tico a la siguiente direcci&oacute;n:</p><p><a href="mailto:consumoproblematicos@chaco.gov.ar">consumoproblematicos@chaco.gov.ar</a></p><p>&nbsp;</p><p>&nbsp;</p><p style="text-align: center;"><strong><a href="https://docs.google.com/forms/d/e/1FAIpQLSfNrDoxISiWc-E8DuaOxHCz1R67WMsQYZdawaDfIXdLEugUpQ/viewform" target="_blank">FORMULARIO DE INSCRIPCI&Oacute;N</a><br /></strong></p><p>&nbsp;</p><p style="text-align: center;"><strong><a href="../../../uploads/publicacion/19a74e78ea69e7e1aea4aca429cad3531e9a30c7.pdf" target="_blank">PROGRAMA Y CRONOGRAMA DEL CURSO</a></strong></p><p>&nbsp;</p><p>&nbsp;</p>', 1),
(191, 'Perfil específico de los destinatarios: personal que tengan contacto directo de atención al público o cuya función implique transmitir información, asesoramiento, contención u orientación al ciudadano o que tenga funciones operativas específicas en los servicios esenciales, críticos y de emergencia.', '<p><strong>DESTINATARIOS:</strong></p><p><strong>Tendr&aacute;n prioridad en la inscripci&oacute;n el personal de los siguientes organismos y oficinas:</strong></p><p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Polic&iacute;a de la provincia del Chaco</p><p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ministerio de Desarrollo Social</p><p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ministerio de Salud P&uacute;blica</p><p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Oficinas de atenci&oacute;n al p&uacute;blico de las jurisdicciones</p><p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Centro de Gesti&oacute;n de Casa de Gobierno</p><p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Mesas de entradas de las jurisdicciones</p><p>&nbsp;</p><p><strong><span lang="ES">DURACI&Oacute;N:&nbsp;&nbsp;</span></strong><span lang="EN-GB">18 horas reloj, distribuidas en 6 (seis) encuentros&nbsp;de tres (3) horas reloj de&nbsp; duraci&oacute;n cada uno.</span></p><p><span lang="EN-GB">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Jueves 11, 18, 28 de agosto, 1, 8 y 15 de septiembre (evaluaci&oacute;n)</span></p><p>&nbsp;</p><p><strong>ADMISI&Oacute;N:&nbsp;</strong>una vez analizadas las solicitudes IPAP chaco informar&aacute; a trav&eacute;s de su correo electr&oacute;nico consignado en la inscripci&oacute;n, la&nbsp;<em>admisi&oacute;n</em>&nbsp;o<em>&nbsp;no admisi&oacute;n</em>&nbsp;al curso.</p><h2><a href="../../../uploads/publicacion/0ab12130a6c6578fc7743ab1f7b2ad271b4a2bcc.pdf" target="_blank">Ver cronograma y detalles del curso aqu&iacute;</a></h2><h2><a href="../../../alumno/cursos/todos" target="_blank">Inscripci&oacute;n aqu&iacute;</a></h2><p>&nbsp;</p><p><strong>INFORMES</strong></p><p><a href="mailto:ipapchaco@gmail.com">ipapchaco@gmail.com</a></p><p>Tel&eacute;fono 4453723</p>', 0),
(231, '1', '<p>&nbsp;</p><table border="0" width="390" cellspacing="0" cellpadding="0"><colgroup><col width="390" /> </colgroup><tbody><tr><td width="390" height="20">JURISDICCI&Oacute;N</td></tr><tr><td class="xl66" height="20">MINISTERIO DESARROLLO URBANO Y ORDENAMIENTO TERRITORIAL</td></tr><tr><td class="xl67" height="20">POLICIA DEL CHACO</td></tr><tr><td class="xl68" height="20">MINISTERIO DE EDUCACION CULTURA CIENCIA Y TECNOLOGIA</td></tr><tr><td class="xl69" height="20">INSSSEP</td></tr><tr><td class="xl70" height="20">MINISTERIO DE INDUSTRIA&nbsp; COMERCIO Y SERVICIOS</td></tr><tr><td class="xl71" height="20">MINISTERIO DE HACIENDA Y FINANZAS</td></tr><tr><td class="xl72" height="20">FISCALIA DE ESTADO</td></tr><tr><td class="xl69" height="20">MINISTERIO DE PRODUCCION</td></tr><tr><td class="xl73" height="20">MINISTERIO DE GOBIERNO, JUSTICIA Y RELACION CON LA COMUNIDAD</td></tr><tr><td class="xl65" height="20">ECOM</td></tr><tr><td class="xl65" height="20">IPDUV</td></tr></tbody></table><p>&nbsp;</p><p>&nbsp;</p><p><strong>IMPORTANTE:</strong>&nbsp;Eval&uacute;e el d&iacute;a y horario conveniente para capacitarse y luego inscr&iacute;base a uno de los cursos. Entregue el formulario generado por el sistema, a la mayor brevedad,&nbsp;para completar su inscripci&oacute;n.</p><p>Las inscripciones se encontrar&aacute;n abiertas&nbsp;<strong>hasta el 01/03/2016 a las 13hs,</strong>&nbsp;o hasta agotarse los cupos, lo que suceda primero.&nbsp;</p><table border="black" width="927"><tbody><tr><th><strong>CURSO</strong></th><th><strong>D&Iacute;AS Y HORARIOS</strong></th><th><strong>CRONOGRAMA</strong></th><th><strong>PRE-INSCRIPCI&Oacute;N</strong></th></tr><tr><td><strong>1. WORD B&Aacute;SICO</strong>&nbsp;&nbsp; &nbsp;</td><td>Martes y jueves de 7.30 a 10 hs</td><td><table width="442"><tbody><tr><td><p><strong>MARTES</strong></p></td><td><p><strong>JUEVES</strong></p></td></tr><tr><td><p><strong>INICIO 07/03</strong></p></td><td><p>09/03</p></td></tr><tr><td><p>1