&nbsp;para las inscripciones de lunes a viernes de 8 a 12hs y de 15 a 19hs, a trav&eacute;s de las siguientes v&iacute;as:</p><p style="text-align: center;">Tel: 4453723</p><p style="text-align: center;">Correo:&nbsp;<a href="mailto:ipapchaco@gmail.com">ipapchaco@gmail.com</a></p><p style="text-align: center;">Direcci&oacute;n: Arturo Illia 26&nbsp;</p>', 0);
