(1, 2, 'Proceso de Registro como Alumno de IPAP', 'Beneficios de Registrarte por ÚNICA VEZ', '<h5><a href="../../../register/" target="_blank">Puede registrarse desde aqu&iacute;</a></h5><h5>El proceso de registro como alumno es&nbsp;<strong>por &uacute;nica vez</strong>&nbsp;y luego Ud. podr&aacute; interactuar con el IPAP con su&nbsp;nombre de usuario y contrase&ntilde;a.&nbsp;</h5><h5>Con el objeto de facilitar el proceso de registro y validaci&oacute;n de sus datos personales a continuaci&oacute;n se describen los pasos necesarios que est&aacute;n mostrados en la Figura.&nbsp;</h5><h5>1. Para iniciar el proceso de registro debe completar el formulario con un email v&aacute;lido, el usuario y la contrase&ntilde;a que desea.</h5><h5>2. Luego recibir&aacute; un mail para validar su correo que ser&aacute; el medio de comunicaci&oacute;n principal con el IPAP. Clic en el bot&oacute;n "Confirme su cuenta".&nbsp;</h5><h5>3. Finalizado el proceso de validaci&oacute;n de email, clic en el bot&oacute;n "Ir a mi secci&oacute;n de Alumno"</h5><h5>4. Ahora es necesario completar sus datos personales. Inicialmente se solicita su DNI y clic en el bot&oacute;n "enviar"</h5><h5>5. El sistema verifica sus datos en la base de datos de empleados provinciales y autocompletar&aacute; parte de ellos en el siguiente paso. Esto facilita el proceso de carga.</h5><h5>6. Es necesario que complete los datos solicitados para mantener un registro v&aacute;lido de los alumnos del IPAP y un medio de contacto r&aacute;pido.</h5><h5>7. Fin del proceso. Clic en "Confirmar". Luego contar&aacute; con un panel propio en el cual puede ver su historial de cursos, imprimir certificados, pre-inscribirse a nuevos cursos y mantener sus datos actualizados.&nbsp;</h5><p><img src="../../../documentos/registro.jpg" alt="Proceso de Registro" width="1009" height="954" /></p>', 0, '2014-01-30 00:00:00', '2016-04-26 12:37:37', '2014-01-29 00:15:21', 51),
(2, 2, 'Becas en el exterior', 'Convocatorias abiertas 2014', '<h1>Convocatorias abiertas de becas para argentinos en el exterior</h1><div><p>Durante el mes de enero han abierto importantes convocatorias de becas en el exterior para ciudadanos argentinos, cofinanciadas por el Ministerio de Educaci&oacute;n, a trav&eacute;s de la Direcci&oacute;n Nacional de Cooperaci&oacute;n Internacional.</p><p>Las convocatorias que se encuentran abiertas son para realizar:</p><p>- Estancias posdoctorales en Espa&ntilde;a. Se recibir&aacute;n las postulaciones hasta el 7 de marzo de 2014</p><p>- Pasant&iacute;as academicas y profesionales en Alemania para estudiantes del &uacute;ltimo a&ntilde;o de ingenier&iacute;a, hasta el 05 de marzo de 2014. Convocatoria para estudiantes con m&iacute;nimo nivel de alem&aacute;n.</p><p>- Masters y doctorados completos en determinadas &aacute;reas en la Rep&uacute;blica de Hungr&iacute;a, hasta el 17 de marzo de 2014.</p><p>- Estancias de investigaci&oacute;n de posgrado y curso de eslavo en Rep&uacute;blica Checa, hasta el 17 de febrero de 2014.</p><p>Pueden encontrar los reglamentos con toda la informaci&oacute;n y requisitos, como as&iacute; tambi&eacute;n los formularios para postular&nbsp;en:</p><p>http://portales.educacion.gov.ar/dnci/becas/becas-de-posgrado-para-argentinos-en-el-exterior/becas-del-ministerio/</p><p>&nbsp;</p></div>', 0, '2014-01-29 00:00:00', '2016-04-28 15:47:27', '2014-01-29 10:28:57', 24),
(3, 1, 'PROFYM: Premio a la Calidad', 'En una ceremonia que se realizó en el Salón Auditorio de la Casa de las Culturas de la Ciudad de Resistencia, la Provincia de Chaco entregó el 12 de diciembre de 2013 los trofeos y distinciones correspondientes a la primera edición  de su Premio Provincial a la Calidad para el Sector Público y Privado', '<p style="margin: 0px 0px 0.5em; padding: 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; text-align: justify; color: #444455; font-family: \'Trebuchet MS\', Helvetica, sans-serif; line-height: 18.239999771118164px;">La Secretaria de Gabinete y Coordinaci&oacute;n Administrativa de la Jefatura de Gabinete de Ministros estuvo representada por el flamante Director Nacional del Instituto Nacional de Administraci&oacute;n P&uacute;blica, Horacio Cao, quien junto con el Secretario General de la Gobernaci&oacute;n, Julio Sotelo, y la Subsecretaria de Coordinaci&oacute;n y Gesti&oacute;n P&uacute;blica Provincial, Maris Telma Gam&oacute;n, encabezaron el acto de apertura. &nbsp;</p><p style="margin: 0px 0px 0.5em; padding: 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; text-align: justify; color: #444455; font-family: \'Trebuchet MS\', Helvetica, sans-serif; line-height: 18.239999771118164px;">&nbsp;</p><p style="margin: 0px 0px 0.5em; padding: 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; text-align: justify; color: #444455; font-family: \'Trebuchet MS\', Helvetica, sans-serif; line-height: 18.239999771118164px;">&ldquo;Construimos un nuevo modelo de Estado y de Provincia para lo cual es fundamental fomentar la calidad en los sectores p&uacute;blico y privado&rdquo;, se&ntilde;al&oacute; Gam&oacute;n, para luego afirmar que &ldquo;muchas organizaciones p&uacute;blicas y privadas ya ven&iacute;an trabajando con normas de calidad como las ISO, pero es importante que el gobierno implemente normas de calidad y reconozca a las entidades que vienen transitando por este camino para llegar a la excelencia&rdquo;.</p><p style="margin: 0px 0px 0.5em; padding: 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; text-align: justify; color: #444455; font-family: \'Trebuchet MS\', Helvetica, sans-serif; line-height: 18.239999771118164px;">&nbsp;</p><p style="margin: 0px 0px 0.5em; padding: 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; text-align: justify; color: #444455; font-family: \'Trebuchet MS\', Helvetica, sans-serif; line-height: 18.239999771118164px;">De este manera Chaco se constituy&oacute; en la segunda provincia del pa&iacute;s en otorgar este tipo de reconocimiento &nbsp;(la primera fue San Juan). &nbsp;21 organizaciones p&uacute;blicas y privadas concursaron por el premio que cont&oacute; &nbsp;con 70 evaluadores capacitados y un jurado de expertos.&nbsp;</p><p style="margin: 0px 0px 0.5em; padding: 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; text-align: justify; color: #444455; font-family: \'Trebuchet MS\', Helvetica, sans-serif; line-height: 18.239999771118164px;">&nbsp;</p><p style="margin: 0px 0px 0.5em; padding: 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; text-align: justify; color: #444455; font-family: \'Trebuchet MS\', Helvetica, sans-serif; line-height: 18.239999771118164px;">Se entregaron premios al Instituto de Medicina y Ciencias Forenses- Centro de tratamiento de residuos especiales (IMCIF-CETRE) en la categor&iacute;a 1, del sector p&uacute;blico; al Instituto CER- Centro de enfermedades renales en la categor&iacute;a 2, sector privado y a BIO-FAR S.A, en la categor&iacute;a 3, del sector privado. Adem&aacute;s, se otorg&oacute; una menci&oacute;n especial a Petro Servicios S.A al criterio de "Gesti&oacute;n de los Procesos".</p><p style="margin: 0px 0px 0.5em; padding: 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; text-align: justify; color: #444455; font-family: \'Trebuchet MS\', Helvetica, sans-serif; line-height: 18.239999771118164px;">&nbsp;</p><p style="margin: 0px 0px 0.5em; padding: 0px; border: 0px; outline: 0px; font-size: 12px; vertical-align: baseline; text-align: justify; color: #444455; font-family: \'Trebuchet MS\', Helvetica, sans-serif; line-height: 18.239999771118164px;">La calidad en la gesti&oacute;n p&uacute;blica constituye una cultura transformadora que impulsa a las administraciones p&uacute;blicas a su mejora permanente para satisfacer progresivamente las necesidades y expectativas de la ciudadan&iacute;a. La calidad en la gesti&oacute;n p&uacute;blica debe medirse en funci&oacute;n de la capacidad para satisfacer las necesidades y expectativas de los ciudadanos, de acuerdo a metas preestablecidas alineadas con los fines y prop&oacute;sitos superiores de la administraci&oacute;n p&uacute;blica y de acuerdo a resultados cuantificables que tengan en cuenta el inter&eacute;s y las necesidades de la sociedad.</p>', 0, '2014-01-29 00:00:00', '2014-03-06 09:43:21', '2014-01-29 10:35:29', NULL),
(4, 1, 'Educación: ¿Nos Conocemos?', 'Video Educativo.', '<p><strong>Videos</strong></p><p>Para navegar e interactuar por Internet en forma segura, los invitamos a ver los videos explicativos sobre las situaciones de riesgo m&aacute;s usuales y las recomendaciones sobre c&oacute;mo actuar frente a ellas para prevenir y evitar da&ntilde;os.</p><p>Las redes sociales, el chat y los blogs son herramientas de uso com&uacute;n y generalizado entre los ni&ntilde;os y adolescentes. Estas herramientas de comunicaci&oacute;n pueden ser utilizadas por personas desconocidas para enga&ntilde;ar a los menores, con diferentes fines. Es la situaci&oacute;n que exhibe el siguiente video, con recomendaciones sobre c&oacute;mo actuar en estos casos.</p>', 1, '2014-01-30 00:00:00', '2014-03-06 09:52:34', '2014-01-30 21:08:51', NULL),
(5, 3, 'Investigaciones', 'Descripcion investigaciones', NULL, 0, '2014-01-30 00:00:00', '2014-01-31 09:57:03', '2014-01-30 21:12:31', NULL),
(6, 3, 'Convocatoria 2014', 'Se lanza el 17 de Febrero la Convocatoria a todos los empleados públicos que deseen presentar proyectos de investigación en el ámbito del IPAP para sus jurisdicciones.', '<p style="margin: 0px 0px 10px; color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px;"><strong><span lang="ES-MX">Per&iacute;odo de recepci&oacute;n de formularios</span></strong><span lang="ES-MX">: desde 17 de Febrero al 14 de Marzo de 2014.</span></p><p style="margin: 0px 0px 10px; color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px;"><span lang="ES-MX">&nbsp;</span></p><p style="margin: 0px 0px 10px; color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px;"><strong><span lang="ES-MX">Objeto</span></strong><span lang="ES-MX">: Promover la investigaci&oacute;n aplicada para resolver problemas en los organismos del Poder Ejecutivo, centralizados, descentralizados y aut&aacute;rquicos.</span></p><p style="margin: 0px 0px 10px; color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px;"><span lang="ES-MX">&nbsp;</span></p><p style="margin: 0px 0px 10px; color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px;"><strong><span lang="ES-MX">Destinatarios</span></strong><span lang="ES-MX">: Agentes de la Administraci&oacute;n P&uacute;blica Provincial que deseen resolver problemas, en base a metodolog&iacute;as de investigaci&oacute;n, en sus jurisdicciones u &oacute;rganos del Estado.</span></p><p style="margin: 0px 0px 10px; color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px;"><span lang="ES-MX">&nbsp;</span></p><p style="margin: 0px 0px 10px; color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px;"><span lang="ES-MX">Se aceptar&aacute;n Proyectos de Investigaci&oacute;n que, por su tem&aacute;tica y calidad, est&eacute;n relacionados al Plan Quinquenal de Desarrollo 2013-2017 y tengan los siguientes alcances:</span></p><ul style="padding: 0px; margin: 0px 0px 10px 25px; color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px;"><li>Realizar estudios para diagnosticar el Estado y proponer acciones que garanticen su desarrollo.</li><li>Desarrollar propuestas que contribuyan a la innovaci&oacute;n de los modelos de gesti&oacute;n.</li><li>Resolver problemas espec&iacute;ficos en diversas jurisdicciones a trav&eacute;s de:</li></ul><ol style="padding: 0px; margin: 0px 0px 10px 25px; color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px;"><ol style="padding: 0px; margin: 0px 0px 0px 25px;"><li>Mejora de procesos e intercomunicaci&oacute;n entre &aacute;reas</li><li>Innovaci&oacute;n y modernizaci&oacute;n de la gesti&oacute;n p&uacute;blica</li><li>Incorporaci&oacute;n de t&eacute;cnicas de mejora continua y gesti&oacute;n hacia la calidad</li><li>Desarrollo de modelos o productos para perfeccionar el servicio prestado a la ciudadan&iacute;a y/o a otros organismos.</li><li>Resolver problemas mediante estudios estad&iacute;sticos y t&eacute;cnicos que contribuyan a agilizar la toma de decisi&oacute;n.</li></ol></ol><p style="margin: 0px 0px 10px; color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px;"><span lang="ES-MX">&nbsp;</span>&nbsp;</p><p style="margin: 0px 0px 10px; color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px;"><span lang="ES-MX"><strong>Asesor&iacute;a y capacitaci&oacute;n.</strong></span></p><p style="margin: 0px 0px 10px; color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px;"><span lang="ES-MX">El equipo t&eacute;cnico del IPAP brindar&aacute; asesor&iacute;as en la redacci&oacute;n de los proyectos, como as&iacute; tambi&eacute;n soporte en los avances que necesiten los diferentes equipos de investigaci&oacute;n.</span></p><p style="margin: 0px 0px 10px; color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px;"><span lang="ES-MX">Adem&aacute;s se capacitar&aacute; a los integrantes de proyectos seleccionados en metodolog&iacute;a de la investigaci&oacute;n con profesionales del &aacute;rea.</span></p><p style="margin: 0px 0px 10px; color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px;"><span lang="ES-MX">&nbsp;</span></p><p style="margin: 0px 0px 10px; color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px;"><span lang="ES-MX"><strong>Acreditaci&oacute;n y Documentos</strong>.</span></p><p style="margin: 0px 0px 10px; color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px;"><span lang="ES-MX">Cada Proyecto de Investigaci&oacute;n est&aacute; enmarcado en el sistema de cr&eacute;ditos para Empleados P&uacute;blicos enunciados en el&nbsp;<a href="../../../documentos/D512.pdf"><strong>Decreto 512/13</strong>.</a></span></p><p style="margin: 0px 0px 10px; color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px;"><span lang="ES-MX">&nbsp;</span></p><p style="margin: 0px 0px 10px; color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px;"><span lang="ES-MX">&nbsp;</span><span lang="ES-MX">El proyecto debe ser presentado&nbsp;</span><span lang="ES-MX">seg&uacute;n lo establecido en la&nbsp;<a href="../../../documentos/R99.pdf"><strong>Resoluci&oacute;n N&deg;099/2013</strong></a>&nbsp;R&eacute;gimen de acreditaci&oacute;n de Proyectos de Investigaci&oacute;n IPAP.</span></p><p style="margin: 0px 0px 10px; color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px;"><span lang="ES-MX">&nbsp;</span></p><p style="margin: 0px 0px 10px; color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px;">Llamado a presentaci&oacute;n de Proyectos de Investigaci&oacute;n 2014.&nbsp;<a href="../../../documentos/R100.pdf">Resoluci&oacute;n N&deg; 100/2013</a></p><p style="margin: 0px 0px 10px; color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px;">&nbsp;</p><p style="margin: 0px 0px 10px; color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px;"><strong><span lang="ES-MX">Consultas</span></strong><span lang="ES-MX">.</span></p><p style="margin: 0px 0px 10px; color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px;"><span lang="ES-MX">En forma personal en la sede del IPAP ubicada en &nbsp;Arturo Illia 26 Planta Baja &ndash; Edificio Olivetti.</span></p><p style="margin: 0px 0px 10px; color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px;"><span lang="ES-MX">Telef&oacute;nicamente al N&deg; 3624-453723. ipap.investigacion@gmail.com</span></p><p style="margin: 0px 0px 10px; color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px;">&nbsp;</p><p style="margin: 0px 0px 10px; color: #333333; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px;"><span lang="ES-MX">Puede coordinar una reuni&oacute;n enviando un mail a&nbsp;<strong>ipap.investigacion@gmail.com</strong>&nbsp;y nuestro equipo t&eacute;cnico lo guiar&aacute; para completar el&nbsp;</span><a href="../../../documentos/Res99-Formularios.docx"><strong>Formulario de Inscripci&oacute;n</strong></a></p><p><strong>&nbsp;</strong></p>', 0, '2014-01-31 00:00:00', '2014-04-29 09:35:25', '2014-01-31 08:03:43', 22),
(17, 3, 'Formularios de la Convocatoria 2014', 'Están disponibles los formularios para presentación de los proyectos.', '<p>Debido a las numerosas consultas de los diferentes organismos sobre los procedimientos de revisi&oacute;n, alcance y presentaci&oacute;n de los formularios para inscribir los proyectos, se ponen a disposici&oacute;n dichos formularios en formato editable. Adem&aacute;s se aclara en cada &iacute;tem lo que se espera de su contenido.&nbsp;</p><p>Asimismo, nuestro equipo de investigaci&oacute;n sugiere que se coordinen reuniones mediante e-mail (ipap.investigacion@gmail.com)&nbsp;con el objeto de aclarar dudas que tenga cada equipo que desee presentar proyectos.&nbsp;</p><p><a href="../../documentos/Res99-Formularios.docx">Formulario click aqu&iacute;</a></p>', 0, '2014-02-20 00:00:00', '2014-04-29 09:35:44', '2014-02-20 10:49:49', 23),
(21, 1, 'Inscripción a Conferencia', 'En el marco del acto de inicio de actividades 2014 en la Casa de las Culturas, se realizará una conferencia sobre "Desarrollo de recursos humanos en los gobiernos latinoamericanos: tendencias y desafíos"', '<p><strong><em>Conferencia "Desarrollo de recursos humanos en los gobiernos latinoamericanos: tendencias y desaf&iacute;os."</em></strong><strong><em>&nbsp;</em></strong><strong>&nbsp;</strong><strong>&nbsp;</strong></p><p><strong>Conferencista:</strong><strong>Mercedes Iacoviello&nbsp;</strong></p><p>Master in Labor Relations por University of Illinois at Urbana-Champaign.&nbsp;Economista &nbsp;por la Universidad de Buenos Aires</p><p>Graduada del Programa de Formaci&oacute;n de Administradores Gubernamentales del INAP de Argentina&nbsp;&nbsp;</p><p><strong>13 de Marzo de 2014 - Casa de las Culturas</strong></p><p><strong>Acreditaci&oacute;n 8hs</strong>&nbsp;&nbsp;</p><p><a href="http://scgp.chaco.gov.ar/conferencia_ipap2014/">PRE- INSCRIPCIONES AQU&Iacute;</a></p>', 0, '2014-02-28 00:00:00', '2014-04-29 09:42:02', '2014-02-28 18:19:17', 25),
(22, 1, 'Tendencias y desafíos de la formación en gestión pública en América Latina', 'Mgter. Mercedes Iacoviello: Tendencias y desafíos de la formación\r\nen gestión pública en América Latina', '<p>La<strong> Mgter. &nbsp;Mercedes Iacoviello</strong> present&oacute; las tendecias actuales en el desarrollo y la formaci&oacute;n de funcionarios en los gobiernos latinoamericanos, a partir de su experiencia en el seguimiento de los servicios civiles de la regi&oacute;n para el Banco Ineteramricano de Desarrollo y la Agencia Espa&ntilde;ola de Cooperaci&oacute;n.<br />Refir&oacute; a la situci&oacute;n general en la regi&oacute;n, identificando algunas experiencias de particular interes, de modo de nutrir con casos concretos la planificaci&oacute;n de la formaci&oacute;n de funcionarios de la Provincia de Chaco.<br /><br /><a href="../../uploads/publicacion/bc05b58c843d9f97426ecb01419686de73cceed2.pdf" target="_blank">Descargar Presentaci&oacute;n PDF</a></p>', 1, '2014-03-14 00:00:00', '2014-03-14 12:18:04', '2014-03-14 12:06:23', NULL),
(23, 1, 'Curso “Gestión de la Calidad”', 'Lanzado en el año 2012 con el objetivo de introducir a los organismos del Sector Público Provincial en la temática de la Gestión de Calidad de modo que puedan iniciar el camino de la transformación.', '<h2><span style="font-family: Calibri, serif;"><span style="font-family: Arial, serif;"><span style="font-size: medium;"><strong><br />Se desarrollar&aacute;n:&nbsp;<br /><br />M&oacute;dulo 10</strong></span></span><span style="font-family: Arial, serif;"><span style="font-size: medium;"> &ldquo;</span></span><span style="font-family: Arial, serif;"><span style="font-size: medium;"><em>La preservaci&oacute;n del entorno f&iacute;sico y socia</em></span></span><span style="font-family: Arial, serif;"><span style="font-size: medium;">l&rdquo; </span></span></span></h2><p><span style="font-family: Calibri, serif;"><span style="font-family: Arial, serif;"><span style="font-size: medium;">Viernes 21 de marzo: De 8 a 12.30 hs y de 14 a 18.30 hs.: Dictado por la Lic. Silvia Vilanova quien desarrollar&aacute; la tem&aacute;tica de las normas de calidad ISO 9001, OHSAS 18001, ISO_14001_2004.</span></span></span></p><p>&nbsp;</p><p><span style="font-family: Calibri, serif;"><span style="font-family: Arial, serif;"><span style="font-size: medium;"><strong>M&oacute;dulo 11</strong></span></span><span style="font-family: Arial, serif;"><span style="font-size: medium;">: &ldquo;Metodolog&iacute;a y Pr&aacute;ctica de Evaluaci&oacute;n&rdquo;</span></span></span></p><p><span style="font-family: Calibri, serif;"><span style="font-family: Arial, serif;"><span style="font-size: medium;">Viernes 28 de marzo: De 8 a 12.30 hs y de 14 a 18.30 hs.: Dictado por el Ing. Miguel Angel Meinero.</span></span></span></p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>', 1, '2014-03-20 00:00:00', '2014-03-21 11:23:23', '2014-03-20 12:20:28', NULL),
