(26, 3, 'Convocatoria de presentación de proyectos de investigación', 'El pasado 14 de marzo cerró la Convocatoria de presentación de proyectos de investigación destinada a Agentes de la Administración Pública Provincial que deseen resolver problemas, en base a metodologías de investigación, en sus jurisdicciones u órganos del Estado.', '<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #333333; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;"><span lang="ES-MX" style="box-sizing: border-box;">Fueron recibidos 19 proyectos que ser&aacute;n evaluados por especialistas para garantizar el nivel de calidad de las investigaciones. Los Proyectos de Investigaci&oacute;n a evaluarse se relacionan con el Plan Quinquenal de Desarrollo 2013-2017 y deber&aacute;n tener los siguientes alcances:</span></p><ul style="box-sizing: border-box; margin: 0px 0px 10px 25px; color: #333333; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; padding: 0px; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;"><li style="box-sizing: border-box;">Realizar estudios para diagnosticar el Estado y proponer acciones que garanticen su desarrollo.</li><li style="box-sizing: border-box;">Desarrollar propuestas que contribuyan a la innovaci&oacute;n de los modelos de gesti&oacute;n.</li><li style="box-sizing: border-box;">Resolver problemas espec&iacute;ficos en diversas jurisdicciones a trav&eacute;s de:</li></ul><ol style="box-sizing: border-box; margin: 0px 0px 10px 25px; color: #333333; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; padding: 0px; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;"><ol style="box-sizing: border-box; margin: 0px 0px 0px 25px; padding: 0px;"><li style="box-sizing: border-box;">Mejora de procesos e intercomunicaci&oacute;n entre &aacute;reas</li><li style="box-sizing: border-box;">Innovaci&oacute;n y modernizaci&oacute;n de la gesti&oacute;n p&uacute;blica</li><li style="box-sizing: border-box;">Incorporaci&oacute;n de t&eacute;cnicas de mejora continua y gesti&oacute;n hacia la calidad</li><li style="box-sizing: border-box;">Desarrollo de modelos o productos para perfeccionar el servicio prestado a la ciudadan&iacute;a y/o a otros organismos.</li><li style="box-sizing: border-box;">Resolver problemas mediante estudios estad&iacute;sticos y t&eacute;cnicos que contribuyan a agilizar la toma de decisi&oacute;n.</li></ol></ol>', 1, '2014-03-21 00:00:00', '2014-03-21 12:06:09', '2014-03-21 11:36:15', NULL),
(27, 1, 'Cierre del Curso de Gestión de la Calidad', 'El Ing. Miguel Angel Meinero desarrollará el Módulo “Metodología y Práctica de Evaluación”.', '<p>El viernes 28 de marzo de 8 a 12.30 hs y de 14 a 18.30 hs y mediante la realizaci&oacute;n de ejercicios pr&aacute;cticos y an&aacute;lisis de casos el Ing. Meinero acercar&aacute; a los participantes elementos que aporten&nbsp;al desarrollo de las instituciones.</p>', 1, '2014-03-27 00:00:00', '2014-03-27 08:17:04', '2014-03-27 08:05:16', NULL),
(32, 1, 'CURSO: REGLAMENTACIONES VIGENTES EN MATERIA DE PERSONAL', 'Con la implementación de esta acción de capacitación se pretende mejorar la comprensión de la documentación que guarda relación con las medidas en materia administración de personal con el que se rige la administración pública.', '<p>Contribuci&oacute;n esperada: Optimizar los tr&aacute;mites referentes a las situaciones de los agentes que revistan en la administraci&oacute;n p&uacute;blica, disminuyendo errores procedimentales de forma y de fondo.</p><p>&nbsp;<a href="../../../uploads/publicacion/967314626b25113c4e09b1392c369c71bc012e39.pdf" target="_blank">Ficha T&eacute;cnica</a>&nbsp;</p>', 1, '2014-04-01 00:00:00', '2014-04-04 12:01:51', '2014-04-01 07:38:13', NULL),
(33, 3, 'TALLER: DISEÑO Y CONSTRUCCIÓN DE INVESTIGACIONES APLICADAS-MÓDULO I', 'El Taller está destinado EXCLUSIVAMENTE a los agentes de la administración pública provincial integrantes de los equipos de investigación que hayan presentado proyectos a la Convocatoria 2014.', '<p>La propuesta tiene la finalidad de brindar herramientas conceptuales y procedimentales para ser implementadas en los distintos momentos del proceso de investigaci&oacute;n. El Taller estar&aacute; a cargo de la Dra. Ana Rosa Pratesi.</p><p><a href="../../../uploads/publicacion/5df7e336fd198f707cfc9396923e66ae6d7c64c1.pdf" target="_blank">Ficha T&eacute;cnica</a></p>', 1, '2014-04-08 00:00:00', '2014-05-14 08:25:35', '2014-04-08 12:34:48', 36),
(41, 2, 'CURSO E-LEARNING "Liderazgo en acción"', 'El curso busca analizar las ideas y concepciones sobre la autoridad -que en general, en los organismos públicos es lineal-jerárquica- para poder reconstruir el concepto de liderazgo. También analizar y reflexionar sobre los elementos que constituyen un liderazgo efectivo, para que a partir de estos, se desarrolle una propuesta contextual de liderazgo en el estado provincial.', '<p>Destinatarios: Directores y Jefes de Departamento de la Administraci&oacute;n P&uacute;blica Provincial.</p><p><a href="../../../uploads/publicacion/fec0da90d2b8a452403fc0440e917e3e3c61cee8.pdf" target="_blank">Ficha T&eacute;cnica</a></p>', 1, '2014-04-11 00:00:00', '2014-04-28 12:32:06', '2014-04-11 12:49:47', 19),
(42, 2, 'CURSO: INTEGRACIÓN DE HERRAMIENTAS (WINDOWS, WORD, EXCEL, ACCESS-Nivel Avanzado)', 'El curso de desarrollará en el Gabinete Informático del IPAP Chaco y estará a cargo de la Capacitadora interna Ing. Yanina Vallejos.', '<p>OBJETIVO GENERAL:<br />&bull; Brindar al alumno formaci&oacute;n avanzada de las herramientas ofim&aacute;ticas para que pueda aplicarlo en su lugar de trabajo en forma eficiente.<br />&bull; Facilitar la integraci&oacute;n de documentos y datos con casos pr&aacute;cticos que pueden ser utilizados en su &aacute;mbito laboral.</p><p><a href="../../../uploads/publicacion/cc7029b543450d9b091d029d3bd52be1499f8412.pdf" target="_blank">Ficha T&eacute;cnica</a></p>', 1, '2014-05-05 00:00:00', '2014-05-09 11:47:29', '2014-05-05 12:57:12', 27),
(44, 2, 'CURSO: INTEGRACIÓN DE HERRAMIENTAS BÁSICAS  (WINDOWS, WORD, EXCEL)', 'El curso de desarrollará en el Gabinete Informático del IPAP Chaco y estará a cargo de la Capacitadora interna Ing. Diana Salinas.', '<p><strong>CONTRIBUCI&Oacute;N ESPERADA:</strong></p><p>*&nbsp;<em>Formar en el uso correcto de las tecnolog&iacute;as de la informaci&oacute;n y de la&nbsp; comunicaci&oacute;n como instrumento de gesti&oacute;n p&uacute;blica.</em></p><p><em>* Formar en&nbsp; habilidades b&aacute;sicas espec&iacute;ficas para operar los puestos de trabajo.</em></p><p><em><a href="../../../uploads/publicacion/879dbb31f209c6a5c4e35065d3b485e6e9dc3bc8.pdf" target="_blank">Ficha T&eacute;cnica</a></em></p>', 1, '2014-05-09 00:00:00', '2014-05-09 11:48:20', '2014-05-09 11:32:07', 30),
(45, 2, 'TALLER DE SERVICIO DE EXCELENCIA AL USUARIO', 'El objetivo del taller apunta a la comprensión y vivencia de situaciones de servicio a las personas en distintas circunstancias y contextos. El servicio de excelencia a las personas involucra acciones con el objetivo de prestar un atención personalizada y con alto desempeño, que trae aparejado una imagen positiva en las personas.', '<p><a href="../../../uploads/publicacion/59dabafce6bff9dc92cea8a275c849924d573711.pdf" target="_blank">Ficha T&eacute;cnica</a></p>', 1, '2014-05-12 00:00:00', '2014-05-13 12:35:49', '2014-05-12 12:56:03', 34),
(46, 1, 'TALLER DE FORMACIÓN Y ACTUALIZACIÓN DE EVALUADORES DEL PREMIO PROVINCIAL A LA CALIDAD', 'El desarrollo de las actividades de formación y actualización logran que los Evaluadores conozcan el Manual Operativo y el Modelo del Premio, que sean capaces de desempeñar el rol para el que fueron seleccionados y que se convierta en un difusor y promotor de la Gestión de la Calidad en todos los ámbitos donde actúe sean estos públicos o privados.', NULL, 1, '2014-05-14 00:00:00', '2014-05-14 10:14:53', '2014-05-14 10:14:10', 37),
(49, 2, 'Introducción a la Gestión de la formación y capacitación en los espacios de trabajo', 'La capacitación tiene como objetivo desarrollar las habilidades pertinentes para detectar y diagnosticar las necesidades de capacitación y entrenamiento del personal de las áreas respectivas y está destinado a Directores de RRHH y Jefes de Dpto Capacitación y Carrera o cargos equivalentes.', '<p><a href="../../uploads/publicacion/708da3bc099b06c7be907f34321aff75432fd723.pdf" target="_blank">Ficha T&eacute;cnica</a></p>', 1, '2014-05-15 00:00:00', '2014-05-15 10:38:06', '2014-05-15 10:29:07', 44),
(51, 1, 'CURSOS DE OFIMATICA ORGANIZADO POR IPAP CHACO EN CONVENIO CON UTN EN JUNIO Y AGOSTO.', 'WORD, EXCEL y ACCESS - Niveles Básico y Avanzado, herramientas fundamentales para el mejor desempeño de los agentes públicos en sus puestos de trabajo.', '<p>La Unidad de Recursos Humanos de cada Jurisdicci&oacute;n debe presentar a la Direcci&oacute;n de Capacitaci&oacute;n, hasta el lunes&nbsp;26&nbsp;de mayo, la n&oacute;mina de agentes a participar en cada curso en la convocatoria del mes de Junio. Los cupos ser&aacute;n otorgados con prioridad a quienes cumplan con la fecha establecida.</p><p><a href="../../uploads/publicacion/b17db434ae32851ef3589338a4cd168c100db596.pdf" target="_blank">D&iacute;as y Horarios de Cursos</a></p><p>&nbsp;Atenci&oacute;n: Los cursos se desarrollar&aacute;n en aulas de UTN.</p>', 1, '2014-05-22 00:00:00', '2014-05-22 12:24:54', '2014-05-22 09:07:28', 50),
(53, 1, 'Beneficios de Registrarte por ÚNICA VEZ', 'Mirá el Proceso de Registro como Alumno de IPAP paso a paso mediante un gráfico detallado', '<h5><a href="../../../register/" target="_blank">Puede registrarse desde aqu&iacute;</a>&nbsp; &nbsp;| &nbsp; <a href="../../../documentos/cuentaGmail.pdf" target="_blank">Como crear una cuenta de correo</a></h5><h5>El proceso de registro como alumno es&nbsp;<strong>por &uacute;nica vez</strong>&nbsp;y luego Ud. podr&aacute; interactuar con el IPAP con su&nbsp;nombre de usuario y contrase&ntilde;a.&nbsp;</h5><h5>Con el objeto de facilitar el proceso de registro y validaci&oacute;n de sus datos personales a continuaci&oacute;n se describen los pasos necesarios que est&aacute;n mostrados en la Figura.&nbsp;</h5><h5>1. Para iniciar el proceso de registro debe completar el formulario con un email v&aacute;lido, el usuario y la contrase&ntilde;a que desea.</h5><h5>2. Luego recibir&aacute; un mail para validar su correo que ser&aacute; el medio de comunicaci&oacute;n principal con el IPAP. Clic en el bot&oacute;n "Confirme su cuenta".&nbsp;</h5><h5>3. Finalizado el proceso de validaci&oacute;n de email, clic en el bot&oacute;n "Ir a mi secci&oacute;n de Alumno"</h5><h5>4. Ahora es necesario completar sus datos personales. Inicialmente se solicita su DNI y clic en el bot&oacute;n "enviar"</h5><h5>5. El sistema verifica sus datos en la base de datos de empleados provinciales y autocompletar&aacute; parte de ellos en el siguiente paso. Esto facilita el proceso de carga.</h5><h5>6. Es necesario que complete los datos solicitados para mantener un registro v&aacute;lido de los alumnos del IPAP y un medio de contacto r&aacute;pido.</h5><h5>7. Fin del proceso. Clic en "Confirmar". Luego contar&aacute; con un panel propio en el cual puede ver su historial de cursos, imprimir certificados, pre-inscribirse a nuevos cursos y mantener sus datos actualizados.&nbsp;</h5><p><img src="../../../documentos/registro.jpg" alt="Proceso de Registro" width="874" height="826" /></p>', 1, '2014-05-23 00:00:00', '2016-01-19 11:57:08', '2014-05-22 10:55:47', 53),
(54, 1, 'Curso "Evaluadores del Premio Provincial a la Calidad"', '¡Atención! Modificación de fechas del Curso.', NULL, 1, '2014-05-28 00:00:00', '2014-05-28 12:29:31', '2014-05-28 12:29:31', 57),
(55, 2, 'Ley Nº 4787 “Organización y funcionamiento de la Administración Financiera – Introducción a la Administración Financiera. Sistema de Contrataciones. Nivel Básico', 'Desde el próximo martes 10 de junio y bajo la modalidad de Taller, la Directora General de Contrataciones del Gobierno Provincial, brindará el sustento conceptual a las prácticas que operan en la administración financiera gubernamental.', '<p>Para participar&nbsp;deber&aacute; completar el formulario de inscripci&oacute;n y entregarlo en la Unidad de Recursos Humanos y/o &aacute;rea de Capacitaci&oacute;n de su Jurisdicci&oacute;n.</p><p><a href="../../../uploads/publicacion/d2bcf31714ae365d98271ec9c2ca60517027ad2b.pdf" target="_blank">Formulario de inscripci&oacute;n</a></p>', 1, '2014-06-04 00:00:00', '2014-06-05 08:12:34', '2014-06-04 09:06:04', 59),
(56, 2, 'Gestión de Bienes Propiedad del Estado', 'El miércoles 11 de junio inicia el Curso-Taller que estará a cargo de la Directora General de Gestión de Bienes quien buscará afianzar los conocimientos teóricos impartidos en capacitación previa y generar espacios de buenas prácticas.', '<p>Para participar deber&aacute; completar el formulario de inscripci&oacute;n correspondiente y entregarlo en la Unidad de Recursos Humanos y/o &aacute;rea de Capacitaci&oacute;n de su Jurisdicci&oacute;n.</p><p><a href="../../../uploads/publicacion/d2bcf31714ae365d98271ec9c2ca60517027ad2b.pdf" target="_blank">Formulario de inscripci&oacute;n</a></p>', 1, '2014-06-04 00:00:00', '2014-06-05 08:15:55', '2014-06-04 10:01:09', 60),
(57, 2, 'REDACCIÓN DE INSTRUMENTOS LEGALES', 'La capacitación ofrecerá una instancia de perfeccionamiento de lectura y escritura para el mejoramiento de la comunicación al interior de las organizaciones públicas que elaboran documentos de distinto tipo, entre los que aparece el informe.', '<p><a href="../../alumno/curso/redacci-n-de-instrumentos-legales-17Jun14" target="_blank">Ficha t&eacute;cnica y pre inscripci&oacute;n</a></p>', 1, '2014-06-16 00:00:00', '2014-06-16 08:35:34', '2014-06-16 08:35:34', 63),
(58, 1, 'Liderazgo en Acción - Modalidad e-learning(virtual)', 'El liderazgo busca transformar la realidad, impactar en la realidad, a través de las personas. Para continuar en ese camino, el próximo miércoles 18 de junio inicia un nuevo grupo del Curso en la modalidad virtual: LIDERAZGO EN ACCIÓN que estará a cargo del Mag. Cristian Marenco.', '<p>Para participar del mismo registrarse y pre inscribirse en:</p><p><a href="../../alumno/curso/liderazgo-en-acci-n-modalidad-e-learning-virtual-18Jun14" target="_blank">Registro y pre inscripci&oacute;n</a></p>', 1, '2014-06-17 00:00:00', '2014-06-17 12:58:41', '2014-06-17 12:58:41', 64),
(59, 2, 'FORMULACION DEL PRESUPUESTO DE LA PROVINCIA DEL CHACO.  ASPECTOS PRÁCTICOS', 'La capacitación tiene como fin que los cursantes logren comprender la normativa vigente y realizar un intercambio con los participantes para aclarar las dudas existentes referentes a la formulación del presupuesto.', '<p><strong><a href="../../../uploads/publicacion/30a7c9cb6fa44a638675214ab7167ccb794e84e3.pdf" target="_blank">Ficha t&eacute;cnica</a></strong></p><p><strong>Duraci&oacute;n</strong>: 9 horas reloj distribuidas en 6 (seis) encuentros de 1,5 horas reloj cada uno, los d&iacute;as martes y jueves de 8 a 9,30 hs.</p><p><strong>Cronograma:&nbsp;</strong>Junio 24, 26 &nbsp; &nbsp;Julio &nbsp;01, 03, 08 y 10&nbsp;</p><p><strong>Cupo: </strong>3 (tres) por organismo</p><p><strong>Sede:</strong> IPAP- Arturo Illia 26- Edificio Olivetti&nbsp;</p>', 1, '2014-06-17 00:00:00', '2014-06-26 07:51:39', '2014-06-17 13:12:51', 65),
(60, 2, 'Curso:  Symphony 2', 'El curso busca fortalecer las áreas de tecnologías de la información y comunicación de la administración pública provincial, en desarrollo de aplicaciones sobre plataformas libres.', '<p>Estar&aacute;n a cargo de la capacitaci&oacute;n los Se&ntilde;ores Gonzalo Alonso y Diego Barros.</p><p><a href="../../uploads/publicacion/95e522c015d567054f8b40ff7be4ee5bb2c2194d.pdf" target="_blank">Ficha T&eacute;cnica</a></p>', 1, '2014-06-18 00:00:00', '2014-06-18 08:39:03', '2014-06-18 08:39:03', 67),
(61, 1, '¡ATENCIÓN! Desde el miércoles 25 de junio NUEVO HORARIO para el Curso GESTIÓN DE BIENES DEL ESTADO: de 8 a 11 hs. Agradecemos la difusión del presente comunicado.', 'La Directora General de Gestión de Bienes del Estado Provincial, Sra Lidia Costas continuará brindando conocimientos teóricos y prácticos y generando espacios de buenas prácticas los lunes y miércoles de 8 a 11 hs.', NULL, 1, '2014-06-24 00:00:00', '2014-06-24 09:41:06', '2014-06-24 09:41:06', 75),
(62, 3, 'Taller "Diseño y Construcción de Investigaciones Aplicadas - Primer Módulo"', 'En el marco de la Convocatoria a todos los empleados públicos que deseen presentar proyectos de investigación en el ámbito del IPAP para sus jurisdicciones y con el objetivo de promover la investigación aplicada para resolver problemas en los organismos del Poder Ejecutivo, continúa el Taller a cargo de la Dra. Ana María Pratesi.', NULL, 1, '2014-06-25 00:00:00', '2014-06-25 07:37:57', '2014-06-25 07:37:57', 76),
(63, 3, 'Proyectos de Investigación aprobados', '16 proyectos de investigación han sido aprobados como resultado de la Convocatoria de presentación de proyectos de investigación destinada a Agentes de la Administración Pública Provincial que deseen resolver problemas, en base a metodologías de investigación, en sus jurisdicciones u órganos del Estado.', '<p><strong>Proyectos aprobados</strong></p><p>*Planificaci&oacute;n de tareas en la Tesorer&iacute;a General de la Provincia (Tesorer&iacute;a General)</p><p>*Mejoras Continuas en la Secretar&iacute;a General (Tesorer&iacute;a)</p><p>*El an&aacute;lisis de la gesti&oacute;n y las finanzas p&uacute;blicas en los municipios de primera categor&iacute;a (Tesorer&iacute;a General)</p><p>*Criterios de distribuci&oacute;n de soluciones habitacionales seg&uacute;n la din&aacute;mica del sistema urbano (IPDUV)</p><p>*Apertura Institucional, generando espacios de democratizaci&oacute;n para la protecci&oacute;n integral (Ministerio de Desarrollo Social)</p><p>*Determinaci&oacute;n de la relaci&oacute;n insumo-producto en el &aacute;rea de Turismo Social del Programa Desarrollo Social (Ministerio de Desarrollo Social)</p><p>*El camino de la Ley: Identificaci&oacute;n del proceso de calidad en tr&aacute;mite parlamentario (Poder Legislativo)</p><p>*Auditor&iacute;a interna de Recursos Humanos, procesos para identificar oportunidades y sistematizar &aacute;reas cr&iacute;ticas, construyendo una matriz de riesgo institucional (Poder Legislativo) *La Funci&oacute;n P&uacute;blica (ProFyM &ndash; IPAP)</p><p>*An&aacute;lisis sobre retenci&oacute;n y motivaci&oacute;n de alumnos en capacitaciones ofrecidas por IPAP (IPAP) *Identificaci&oacute;n del tratamiento &oacute;ptimo para los efluentes l&iacute;quidos en conjunto del parque industrial de Puerto Tirol (APA)</p><p>*Evaluaci&oacute;n del grado de eficiencia del sistema de calidad ISO 9001-2008 en el laboratorio de aguas de la APA (APA)</p><p>*Creaci&oacute;n de un panel de donantes fenotipados en el Centro de Hemoterapia (Ministerio de Salud P&uacute;blica)</p><p>*Evaluaci&oacute;n de la Alimentaci&oacute;n Complementaria en ni&ntilde;os menores de dos a&ntilde;os en los centros de atenci&oacute;n primaria&nbsp; (Ministerio de Salud P&uacute;blica)</p><p>*Criterios del Premio Provincial de la Calidad en la ATP (ATP)</p><p>*Buenas pr&aacute;cticas en la administraci&oacute;n estrat&eacute;gica de Bienes del Estado (Direcci&oacute;n General de Bienes).</p><p>Comienza ahora la etapa de firma de convenios con las autoridades de los organismos donde se aplicar&aacute;n las investigaciones. &nbsp;</p>', 1, '2014-06-26 00:00:00', '2014-06-26 08:53:55', '2014-06-26 08:53:55', 81),
(64, 3, 'Firma de Convenio IPAP y Cámara de Diputados', 'El presidente de la Cámara de Diputados, Darío Bacileff Ivanoff y la presidente del Instituto Provincial de la Administración Pública (IPAP Chaco), Maris Telma Gamón, firmaron un convenio para la puesta en marcha de dos proyectos de investigación destinados a mejorar la labor legislativa.', '<p><a href="https://www.youtube.com/watch?v=XuKm86N0t2U" target="_blank">Firma de Convenio IPAP Chaco y C&aacute;mara de Diputados</a></p>', 1, '2014-07-01 00:00:00', '2014-07-01 10:25:30', '2014-07-01 10:23:40', 84),
(65, 2, 'Curso: ORATORIA MODERNA: COMO HABLAR EN PUBLICO” (Nivel 1)', 'El Dr. Rolando Martín Andolfi lleva adelante este curso con el objetivo de mejorar la percepción de las particularidades del proceso comunicativo humano para desarrollar las propias habilidades comunicativas así como procurar el dominio de los instrumentos y herramientas necesarios para el desarrollo de la correcta expresión oral en ámbitos públicos.', NULL, 1, '2014-07-01 00:00:00', '2014-07-01 11:46:34', '2014-07-01 11:46:34', 85),
(66, 2, 'REPETICIÓN Curso Información Sumaria y Sumario Administrativo-Módulo 1', 'Será dictado el jueves 3 de julio de 9 a 12 hs. y estará a cargo del Magister Abogado Miguel A. Garrido. INFORMES: TE 4448009-4448096 o al correo electrónico: agg.capacita@gmail.com.', NULL, 1, '2014-07-02 00:00:00', '2014-07-02 07:43:58', '2014-07-02 07:43:26', 86),
(67, 1, 'AVISO IMPORTANTE', 'Informamos que a partir del día martes 1º de julio el ÚNICO correo electrónico habilitado para comunicación con IPAP Chaco es: ipapchaco@gmail.com. Agradecemos difusión de la presente información.', NULL, 1, '2014-07-02 00:00:00', '2014-07-02 08:20:52', '2014-07-02 08:20:52', 87);
