INSERT INTO `seccion` (`id`, `titulo`, `url`, `contenido`) VALUES
(1, 'Acerca de IPAP', 'acercadeipap', '<h1 style="text-align: center;">IPAP&nbsp;CHACO</h1><p style="text-align: justify;">Es un ente aut&aacute;rquico que tiene por objeto el gobierno y gesti&oacute;n del sistema provincial de capacitaci&oacute;n, investigaci&oacute;n y modernizaci&oacute;n del Sector P&uacute;blico Provincial.</p><h2 style="text-align: justify;">Son objetivos del IPAP Chaco:</h2><p style="text-align: justify;"><strong>a)</strong> Planificar y ejecutar programas de capacitaci&oacute;n, especializaci&oacute;n, actualizaci&oacute;n y formaci&oacute;n de los recursos humanos de los organismos p&uacute;blicos asociados a los lineamientos establecidos para la modernizaci&oacute;n y profesionalizaci&oacute;n del empleo p&uacute;blico.</p><p style="text-align: justify;"><strong>b)</strong> Evaluar el impacto de las capacitaciones realizadas en su &aacute;mbito, a fin de asegurar &oacute;ptimos resultados en el desempe&ntilde;o de los servidores p&uacute;blicos.</p><p style="text-align: justify;"><strong>c)</strong> Promover, organizar, desarrollar y evaluar planes y proyectos de investigaci&oacute;n b&aacute;sica multidisciplinarios a fin de contribuir a la formaci&oacute;n de bagaje te&oacute;rico, conceptual y metodol&oacute;gico para diagnosticar el estado de la Administraci&oacute;n P&uacute;blica y proponer acciones que garanticen su desarrollo.</p><p style="text-align: justify;"><strong>d)</strong> Programar, coordinar y desarrollar proyectos de investigaci&oacute;n que contribuyan a la innovaci&oacute;n de los modelos de gesti&oacute;n del Estado para el logro de la eficiencia, eficacia, transparencia y equidad de los bienes y servicios p&uacute;blicos prestados.</p>'),
(3, 'Informe de gestión 2015', 'informedegestion', '<p><a href="../../../uploads/publicacion/f01d1427d2820967a9fa2515eab4dd4ba2be3d83.pdf" target="_blank">Compartimos con ustedes nuestro Informe de Gesti&oacute;n 2015</a></p><p style="text-align: justify;">&nbsp;</p>'),
(4, 'Ejes Estratégicos', 'ejesestrategicos', '<h2>LINEAMIENTOS DE ACCI&Oacute;N</h2><p><strong>FUNDAMENTACI&Oacute;N.</strong></p><p>&nbsp;El IPAP CHACO, creado en el a&ntilde;o 2012, como organismo rector del sistema provincial de capacitaci&oacute;n, investigaci&oacute;n y modernizaci&oacute;n del Estado de acuerdo a la Ley Provincial N&deg; 7135, presta un servicio de car&aacute;cter transversal a todo el Estado Provincial generando cursos de acci&oacute;n que hagan posible la profesionalizaci&oacute;n y perfeccionamiento permanente de los cuadros pol&iacute;ticos y personal de la administraci&oacute;n p&uacute;blica como as&iacute; tambi&eacute;n la generaci&oacute;n y difusi&oacute;n de conocimiento para la innovaci&oacute;n y modernizaci&oacute;n de la gesti&oacute;n p&uacute;blica,&nbsp; contextualizado y adquirido a trav&eacute;s del an&aacute;lisis de la realidad provincial. &nbsp;</p><p>El presente plan tiene como objetivo delinear las metas de gobierno de la instituci&oacute;n en tres programas espec&iacute;ficos, y seg&uacute;n los ejes de gobierno definidos: el primero, referido a la formaci&oacute;n de recursos humanos; el segundo, a investigaci&oacute;n; y el tercero, al fortalecimiento institucional espec&iacute;fico para el IPAP.</p><p>&nbsp;<strong>Programa 1 &ndash; FORMACI&Oacute;N DE RECURSOS HUMANOS</strong></p><p>Metas del &aacute;rea acad&eacute;mica.</p><p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Formaci&oacute;n de cuadros pol&iacute;ticos y directivos.</p><p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Formaci&oacute;n para la innovaci&oacute;n y calidad institucional.</p><p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Formaci&oacute;n para Estado en red.</p><p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Desarrollo de competencias laborales.</p><p>&nbsp;<strong>Programa 2 &ndash; INVESTIGACI&Oacute;N</strong></p><p>Metas del &aacute;rea de&nbsp; investigaci&oacute;n.</p><p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Desarrollo de buenas pr&aacute;cticas en las jurisdicciones estatales.</p><p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Fortalecimiento de la Innovaci&oacute;n en el sector p&uacute;blico.</p><p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Desarrollo de una red para la gesti&oacute;n del conocimiento provincial.</p><p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Fortalecimiento del Centro Provincial de&nbsp; Documentaci&oacute;n.</p><p>&nbsp;<strong>Programa 3 &ndash; FORTALECIMIENTO INSTITUCIONAL</strong></p><p>Metas &nbsp;de fortalecimiento</p><p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Profesionalizaci&oacute;n del personal del IPAP CHACO.</p><p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Implementaci&oacute;n del Sistema de gesti&oacute;n de calidad institucional.</p><p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ampliaci&oacute;n de las plataformas digitales y sistemas inform&aacute;ticos propios.</p><p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Incremento Convenios de asistencia y cooperaci&oacute;n con organismos p&uacute;blicos de distintos niveles de gobierno y administraci&oacute;n y entes privados, tanto nacionales como internacionales.</p><p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Posicionamiento del IPAP como autoridad funcional en materia de capacitaci&oacute;n e investigaci&oacute;n a nivel provincial y como referente t&eacute;cnico en materia de administraci&oacute;n p&uacute;blica en otros &aacute;mbitos de gobierno.</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>'),
(5, 'Sede', 'sede', '<p>Edificio Olivetti</p><p>Peatonal Illia 26 - Planta Baja y 1&deg; Piso</p><p>Tel&eacute;fono: 362 - 4453723 - Mesa de Entradas: Interno 30; Secretar&iacute;a: Interno 33; Vocal&iacute;a Acad&eacute;mica: Interno 31; Vocal&iacute;a de Investigaci&oacute;n: Interno 32</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>'),
(6, 'Convenios', 'convenios', '<p><strong>Convenios de capacitaci&oacute;n, cooperaci&oacute;n e intercambio acad&eacute;mico y t&eacute;cnico con universidades de la regi&oacute;n y organizaciones p&uacute;blicas</strong></p><p>&nbsp;</p><p>&nbsp;</p><p><strong>Convenios de colaboraci&oacute;n y apoyo para la ejecuci&oacute;n Proyectos de Investigaci&oacute;n con organizaciones p&uacute;blicas</strong></p><p>&nbsp;</p>'),
(8, 'Visión y Misión', 'misionyvision', '<h2>Visi&oacute;n</h2><p style="text-align: justify;">Ser un organismo de capacitaci&oacute;n e investigaci&oacute;n, protagonista del desarrollo integral de la administraci&oacute;n p&uacute;blica provincial, basado en la calidad y excelencia.</p><h2>Misi&oacute;n</h2><p style="text-align: justify;">&nbsp;</p><p style="text-align: justify;">Es la misi&oacute;n del IPAP Chaco, el desarrollo de actividades de capacitaci&oacute;n e investigaci&oacute;n que contribuyan a incorporar buenas pr&aacute;cticas en los agentes p&uacute;blicos y concebir modelos de gesti&oacute;n innovadores fundados en la &eacute;tica y la transparencia, propiciando una cultura de participaci&oacute;n cuidadana.&nbsp;</p>'),
(9, 'Normativa', 'normativa', '<p>Ley de Creaci&oacute;n del IPAP - Ley 7135 -&nbsp;<a href="../../../uploads/publicacion/1cd71a0613579e2adb8442a71775c1ae1d36dbba.pdf" target="_blank">Creaci&oacute;n de IPAP</a></p><p>Decreto Reglamentario - 512/13 -&nbsp;<a href="../../../uploads/publicacion/8482080cbcbe22ada5b0daaa36420e597a654ef8.pdf" target="_blank">Reglamentaci&oacute;n Ley Creaci&oacute;n de IPAP</a></p><p>Decreto - 1175/13 &nbsp;- <a href="../../../documentos/1175.pdf" target="_blank">Estructura Org&aacute;nica</a></p><p>Resoluci&oacute;n. Registro Provincial de Capacitadores IPAP Chaco - <a href="../../../uploads/publicacion/3a56ff75c2641f48fbf199d713109bc7310ff499.pdf">Res. N&deg; 50/2014</a></p><p>Acuerdo Federal para la gesti&oacute;n p&uacute;blica. Compromiso Federal de Objetivos y Metas 2010-2016. Decreto 771/11 -&nbsp;<a href="../../../uploads/publicacion/866cbabfc95876e7b2f8afb1a87bd7373fd90d1a.pdf" target="_blank">Acuerdo General para la Gesti&oacute;n P&uacute;blica</a></p><p>C&oacute;digo Iberoamericano de Buen Gobierno -&nbsp;<a href="../../../uploads/publicacion/6fd6b8fea3f3c95b5887108b33e738874c4a2649.pdf" target="_blank">C&oacute;digo Iberoamericano de buen gobierno</a></p><p>Carta Iberoamericana de Calidad -&nbsp;<a href="../../../uploads/publicacion/30ba039e7082e1ed491ad9c9829d3a49d49e2e7c.pdf" target="_blank">Carta Iberoamericana de Calidad</a></p><p>Carta Iberoamericana de Gobierno Electr&oacute;nico -&nbsp;<a href="../../../uploads/publicacion/716d3a5a05352ac77bb707e37d1898f3e77792c5.pdf" target="_blank">Carta Iberoamericana de Gobierno Electr&oacute;nico</a></p><p>Carta Iberoamericana de la Funci&oacute;n P&uacute;blica -&nbsp;<a href="../../../uploads/publicacion/49bdf53c6a39892977c4024a0bf58770faae2b24.pdf" target="_blank">Carta Iberoamericana de la Funci&oacute;n P&uacute;blica</a></p><p>Carta Iberoamericana de Participaci&oacute;n Ciudadana -&nbsp;<a href="../../../uploads/publicacion/2dd7ec7324e63a0587c65f303a647b4f471e40f4.pdf" target="_blank">Carta Iberoamericana de Participaci&oacute;n Ciudadana</a></p><p>&nbsp;</p>'),
(10, 'Convocatoria a Proyectos de Investigación 2017', 'convocatoriaproyectos', '<p>Nuevamente el Instituto Provincial de Administraci&oacute;n P&uacute;blica del Chaco (IPAP Chaco) invita a la presentaci&oacute;n de ideas proyecto en el marco de la CONVOCATORIA 2017 de acuerdo a la Resoluci&oacute;n IPAP Chaco N&ordm; 36/17.<br />A continuaci&oacute;n se presentan una serie de documentos que ser&aacute;n necesarios para conocer lo desarrollado en el &aacute;rea de investigaci&oacute;n del Instituto como as&iacute; tambi&eacute;n tener la normativa y los formularios necesarios:</p><p><strong>1.</strong>&nbsp;Leer el &nbsp;material bibliogr&aacute;fico &nbsp;denominado&nbsp;<a href="../../../uploads/publicacion/d7456d535d46a87b2787bbafa31b11aea7ee948b.pdf"><strong>&ldquo;&iquest;QU&Eacute; ES INVESTIGACI&Oacute;N?</strong>&rdquo;</a>&nbsp;especialmente pensado para aquellos que quieren informarse sobre que es una investigaci&oacute;n. Este material va a desarrollado en el Taller.</p><p><strong>2.&nbsp;</strong>Resoluciones IPAP Chaco:<strong>&nbsp;<a href="../../../uploads/publicacion/53ebbe7ce087d88aa0e64afe8c4e87a0d1fd5f63.pdf" target="_blank">N&deg; 99/ 13</a>&nbsp;<a href="../../../uploads/publicacion/dae5332293c90dd4fdf80444b2a064a05d54ac4a.pdf" target="_blank">N&deg; 13/15</a>&nbsp;<a href="../../../uploads/publicacion/c12273af8ad48076f23e6500333de6810a5067cf.pdf" target="_blank">N&deg; 36/ 17</a></strong></p><p><strong>CONTACTO:</strong></p><p>Mail:&nbsp;<a href="mailto:ipap.investigacion@gmail.com">ipap.investigacion@gmail.com</a></p><p>Tel&eacute;fono: 0362-4453723</p><p>Direcci&oacute;n: A. Illia 26 Edificio Olivetti, planta baja, de 8 a 12 horas</p>'),
(12, 'Enlaces Relacionados', 'enlaces', '<p><a href="http://www.inap.jefatura.gob.ar/" target="_blank">Instituto Nacional de Administraci&oacute;n P&uacute;blica (INAP Argentina)</a></p><p><a href="http://www.inap.es/" target="_blank">Instituto Nacional de Administraci&oacute;n P&uacute;blica (INAP Espa&ntilde;a)</a></p><p><a href="http://www.direcciondepersonal.jujuy.gov.ar/ipap/" target="_blank">Instituto Provincial de Administraci&oacute;n P&uacute;blica de la Provincia de Jujuy</a>&nbsp;</p><p><a href="http://rig.tucuman.gov.ar/ipap/inicio.php" target="_blank">Instituto Provincial de Administraci&oacute;n P&uacute;blica de la Provincia de Tucum&aacute;n (IPAP Tucum&aacute;n)</a></p><p><a href="https://es-es.facebook.com/ipap.catamarca" target="_blank">Instituto Provincial de la Administraci&oacute;n P&uacute;blica de la Provincia de Catamarca (IPAP Catamarca)</a></p><p><a href="http://www.ipap.sg.gba.gov.ar/">Instituto Provincial de Administraci&oacute;n P&uacute;blica de la Provincia de Buenos Aires (IPAP Buenos Aires)</a></p><p><a href="https://www.cofefup.gob.ar/" target="_blank">Consejo Federal de la Funci&oacute;n P&uacute;blica (COFEFUP)</a></p><p><a href="http://www.clad.org/" target="_blank">Centro Latinoamericano de Administraci&oacute;n para el Desarrollo (CLAD)</a></p><p>&nbsp;</p>'),
(13, 'Proceso de Registro', 'registro', '<h5 style="text-align: justify;">El proceso de registro como alumno es <span style="text-decoration: underline;"><strong>por &uacute;nica vez</strong> </span>y luego Ud. podr&aacute; interactuar con el IPAP con su&nbsp;nombre de usuario y contrase&ntilde;a.&nbsp;</h5><h5 style="text-align: justify;">Con el objeto de facilitar el proceso de registro y validaci&oacute;n de sus datos personales a continuaci&oacute;n se describen los pasos necesarios que est&aacute;n mostrados en la Figura.&nbsp;</h5><h5 style="text-align: justify;">1. Para iniciar el proceso de registro debe completar el formulario con un email v&aacute;lido, el usuario y la contrase&ntilde;a que desea.</h5><h5 style="text-align: justify;">2. Luego recibir&aacute; un mail para validar su correo que ser&aacute; el medio de comunicaci&oacute;n principal con el IPAP. Clic en el bot&oacute;n "Confirme su cuenta".&nbsp;</h5><h5 style="text-align: justify;">3. Finalizado el proceso de validaci&oacute;n de email, clic en el bot&oacute;n "Ir a mi secci&oacute;n de Alumno"</h5><h5 style="text-align: justify;">4. Ahora es necesario completar sus datos personales. Inicialmente se solicita su DNI y clic en el bot&oacute;n "enviar"</h5><h5 style="text-align: justify;">5. El sistema verifica sus datos en la base de datos de empleados provinciales y autocompletar&aacute; parte de ellos en el siguiente paso. Esto facilita el proceso de carga.</h5><h5 style="text-align: justify;">6. Es necesario que complete los datos solicitados para mantener un registro v&aacute;lido de los alumnos del IPAP y un medio de contacto r&aacute;pido.</h5><h5 style="text-align: justify;">7. Fin del proceso. Clic en "Confirmar". Luego contar&aacute; con un panel propio en el cual puede ver su historial de cursos, imprimir certificados, pre-inscribirse a nuevos cursos y mantener sus datos actualizados.&nbsp;</h5><p><img src="../../../documentos/registro.jpg" alt="Registro &uacute;nico" width="965" height="1084" /></p>'),
(14, 'Encuentro Regional sobre Gestión Documental y Archivología en el Estado', 'encuentroarchivologia', '<h4 style="text-align: justify;">El&nbsp;5 de Diciembre de 2014 se realiz&oacute; el primer Encuentro regional que cont&oacute; con&nbsp;Conferencias y talleres a cargo del Archivo General de la Naci&oacute;n, la Biblioteca Nacional de Maestros, el Instituto Nacional de Administraci&oacute;n P&uacute;blica y la participaci&oacute;n de expositores destacados del NEA. El lema: &ldquo;Calidad, Nuevas Tecnolog&iacute;as y Gesti&oacute;n del Conocimiento en el manejo de la documentaci&oacute;n en las organizaciones del Estado&rdquo;. La actividad se llev&oacute; a cabo en el sal&oacute;n de conferencias del Colegio de Escribanos (Resistencia-Chaco).</h4><p>&nbsp;Los <strong>objetivos</strong> del Encuentro fueron:</p><ul style="list-style-type: undefined;"><li>Exponer casos de &eacute;xito y buenas pr&aacute;cticas de archivolog&iacute;a y gesti&oacute;n documental aplicada al Estado utilizando las nuevas tecnolog&iacute;as y herramientas de calidad.</li><li>Generar un foro de discusi&oacute;n sobre nuevas tendencias para el manejo y la administraci&oacute;n de la documentaci&oacute;n y los archivos en el Estado.</li><li>Implementar una red de intercambio de documentaci&oacute;n e informaci&oacute;n sobre administraci&oacute;n p&uacute;blica a nivel regional.</li></ul><p><strong>&Aacute;reas tem&aacute;ticas</strong>:</p><ul style="list-style-type: undefined;"><li>Casos de &eacute;xito y recomendaciones en el tratamiento de los archivos como &ldquo;fuentes de conocimiento&rdquo;</li><li>Tecnolog&iacute;a aplicada a la gesti&oacute;n documental del Estado</li><li>Nuevas tendencias de archivolog&iacute;a</li><li>Redes de coordinaci&oacute;n e intercambio de&nbsp; informaci&oacute;n en gesti&oacute;n documental</li></ul><p style="text-align: left;">&nbsp;</p><p><a href="../../../documentos/certificados/index.htm">Descargar certificados de asistencia</a></p><p><a href="../../../documentos/certificados/material.html">Ver presentaciones de los expositores</a></p><p><a href="https://www.facebook.com/media/set/?set=a.731340683626681.1073741835.556720111088740&amp;type=1">Ver galer&iacute;a fotogr&aacute;fica del Encuentro</a></p><p><a href="../../../uploads/publicacion/73fd8e49d272ee2f8268f9a627cf80f982bd37bf.pdf">Programa del Encuentro</a></p>'),
(15, 'GESTIÓN POR RESULTADOS', 'gestion', '<p>En virtud del Convenio firmado entre el IPAP CHACO y el Ministerio de Planificaci&oacute;n y Ambiente de la Provincia del Chaco, se desarrollar&aacute; entre <strong>marzo y abril</strong> la capacitaci&oacute;n sobre <strong>GESTI&Oacute;N POR RESULTADOS.</strong></p><p>El curso est&aacute; <strong>orientado a los siguientes perfiles:</strong></p><ul><li>Directores, jefes y responsables de proyecto de las Unidades de Planificaci&oacute;n Sectorial de la Administraci&oacute;n Central y de los Organismos descentralizados y aut&aacute;rquicos.</li><li>Directores y jefes de las &aacute;reas contables de los Servicios Administrativos Financieros de las jurisdicciones.</li><li>Directores de Recursos Humanos y jefes de los departamentos de asistencia y liquidaci&oacute;n de haberes de la Administraci&oacute;n Central y de&nbsp; los Organismos descentralizados y aut&aacute;rquicos.</li></ul><p>Se solicita se respete el perfil del participante, a los efectos de permitir el aprovechamiento integral de esta capacitaci&oacute;n. Los pasos para participar en la actividad son:</p><p><a href="../../../alumno/cursos/todos">Si es usuario ingrese aqu&iacute; para pre inscribirse al curso </a></p><p><a href="../../../detalle-noticia/1/ipap">Si a&uacute;n no es usuario ingrese aqu&iacute; para conocer c&oacute;mo registrarse</a></p><p>&nbsp;</p><p>Una vez pre-inscripto hasta el <strong>6 de marzo de 2015</strong> presentar el <strong>formulario de Inscripci&oacute;n Impreso</strong> y firmado por el jefe que autoriza al agente a asistir a la capacitaci&oacute;n, en nuestra sede Arturo Illia 26 (Planta Baja) de lunes a viernes de 7 a 13hs.</p><p><strong>Confirmaci&oacute;n de la inscripci&oacute;n:</strong> oportunamente, el IPAP Chaco informar&aacute; la n&oacute;mina de inscriptos definitiva, as&iacute; como el horario y comisi&oacute;n que le corresponda a cada agente.&nbsp;</p><p><a href="../../../uploads/publicacion/48db5fbaededaa0c86af40cfa14cec57a0f2c240.pdf">Descargar Ficha T&eacute;cnica</a></p><p><a href="../../../uploads/publicacion/1decd39c5288e4db5f1a32610ef0255bf3e70333.pdf">Descargar Formulario de inscripci&oacute;n</a></p><p>&nbsp;</p>'),
(16, '7 de abril: CHARLA "APLICACIÓN DE HERRAMIENTAS DE CALIDAD EN EL SECTOR PÚBLICO PROVINCIAL"', 'herramientasgestion', '<p>Fecha y Lugar:&nbsp; <strong>ATENCI&Oacute;N</strong> la actividad prevista realizarse el 31 de marzo, se ha reprogramado para el <strong>7 DE ABRIL </strong>en el mismo horario, de <strong>8 a 11hs</strong> en la sede del instituto ubicada en Arturo Illia 26</p><p><strong>La actividad tiene por finalidad:</strong></p><ul><li>Promover las Herramientas de Calidad susceptibles de aplicaci&oacute;n en el Sector P&uacute;blico de la Provincia del Chaco.</li><li>Identificar agentes interesados en la tem&aacute;tica que contribuyan a la aplicaci&oacute;n de las herramientas de calidad promovidas en sus &aacute;mbitos de trabajo.</li><li>Lograr la aplicaci&oacute;n de las herramientas en Organizaciones P&uacute;blicas en el corto plazo</li></ul><p><strong>Destinatarios:</strong></p><p><em><strong>Fundamentalmente agentes del nivel Directivo: Directores Generales, Directores, Coordinadores de Programas, Jefes de servicios o agentes que tengan inter&eacute;s en aplicar herramientas de calidad en el &aacute;rea en la que se desempe&ntilde;an.</strong></em></p><p>&nbsp;</p><p>Para participar los interesados deber&aacute;n <strong>pre-inscribirse&nbsp;</strong>y presentar en nuestra sede el <strong>formulario de inscripci&oacute;n</strong> hasta el d&iacute;a <strong>30 de marzo</strong> a las 13hs.</p><p><a href="../../../alumno/cursos/todos">Si es usuario ingrese aqu&iacute; para pre inscribirse al curso </a></p><p><a href="../../../detalle-noticia/1/ipap">Si no es usuario ingrese aqu&iacute; para conocer c&oacute;mo registrarse</a></p><p>&nbsp;</p><p>Ficha t&eacute;cnica con detalles de la actividad:</p><p><a href="../../../uploads/publicacion/61bcf9d4235d62c7d7b6f523789f8cf84070830d.pdf">Descargar Ficha T&eacute;cnica</a></p><p>&nbsp;</p><p>Formulario de inscripci&oacute;n:</p><p><a href="../../../uploads/publicacion/1decd39c5288e4db5f1a32610ef0255bf3e70333.pdf">Descargar Formulario de inscripci&oacute;n</a></p>'),
(17, 'TALLER: DISEÑO Y CONSTRUCCIÓN DE INVESTIGACIONES APLICADAS  PRIMER MÓDULO', 'metodologiamodulo1', '<p><strong>Duraci&oacute;n</strong>: 8 horas reloj distribuidas en 4 (cuatro) encuentros de 2 (dos) horas reloj cada uno, los d&iacute;as martes de 8 a 10 hs.</p><p><strong>Cronograma: </strong>Abril 21 y 28 - Mayo 12 y 26</p><p><strong>Fundamentaci&oacute;n</strong>:</p><p>En el marco de la Convocatoria a todos los empleados p&uacute;blicos que deseen presentar proyectos de investigaci&oacute;n en el &aacute;mbito del IPAP para sus jurisdicciones, con el objetivo de promover la investigaci&oacute;n aplicada para resolver problemas en los organismos del Poder Ejecutivo, centralizados, descentralizados y aut&aacute;rquicos, se propone este Taller como respuesta a la demanda de Empleados P&uacute;blicos que expresan su inter&eacute;s por desarrollar un proceso de investigaci&oacute;n que genere conocimientos aplicables a la gesti&oacute;n p&uacute;blica.</p><p>La propuesta tiene la finalidad de brindar herramientas conceptuales y procedimentales para ser implementadas en los distintos momentos de ese proceso haciendo hincapi&eacute; en la correcta formulaci&oacute;n y definici&oacute;n de la investigaci&oacute;n.</p><p><strong>Destinatarios: </strong>Agentes de la administraci&oacute;n p&uacute;blica provincial que deseen integrar equipos de investigaci&oacute;n y presentar ideas proyecto en la convocatoria 2015 del IPAP.</p><p><a href="../../../uploads/publicacion/3068afa7148a24d053224db2fa0e005f50b19621.pdf">Ver detalles del curso en ficha t&eacute;cnica</a></p>'),
(18, '“Análisis y redacción de instrumentos legales”', 'analisisyredaccion', '<ol><li><strong>FUNDAMENTACI&Oacute;N: </strong></li></ol><p>Esta capacitaci&oacute;n intentar&aacute; ofrecer una instancia de formaci&oacute;n en lectura y escritura para el mejoramiento de la comunicabilidad al interior de las organizaciones p&uacute;blicas; concretamente, abordar&aacute; problem&aacute;ticas de comprensi&oacute;n y producci&oacute;n de instrumentos legales, propiciando el an&aacute;lisis reflexivo en torno de tales tipos textuales.</p><p>&nbsp;</p><ol start="2"><li><strong>OBJETIVOS: (de aprendizaje)</strong></li></ol><ol><ul><li>desarrollar la lectura interpretativa de textos del propio &aacute;mbito laboral; &nbsp;</li><li>desarrollar estrategias para mejorar &nbsp; &nbsp; &nbsp; la producci&oacute;n de instrumentos legales.</li></ul></ol><p><strong>&nbsp;</strong></p><ol start="3"><li><strong>DESTINATARIOS: </strong>Empleado del Estado Provincial ingresados en los &uacute;ltimos a&ntilde;os a la Administraci&oacute;n P&uacute;blica, de la planta Permanente o Transitoria, con funciones administrativas<strong>.</strong></li><li><strong>DURACI&Oacute;N:</strong> 21 hs total, distribuidas en siete (7) d&iacute;as, de 3 horas.<strong>&nbsp;&nbsp; S</strong><strong>emanas</strong><strong>: </strong>4 semanas</li></ol><p><a href="../../uploads/publicacion/6cc10d21bf6c5a45699ac3f38823766b4935cb0e.pdf">Ficha t&eacute;cnica del curso</a></p>'),
(19, 'Cursos de Informática', 'informatica', '<p>OFERTA CURSOS DE INFORM&Aacute;TICA:</p><ul><li><strong>1 (uno) curso de Microsoft Word y Excel B&aacute;sicos </strong>con una carga horaria de 24 hs. de duraci&oacute;n el curso, con clases de 2.30 hs. reloj cada uno. <strong>INICIO: Lunes 20/4</strong></li><li><strong>1 (uno) curso de Microsoft Word Avanzado</strong> con una carga horaria de 24 hs. de duraci&oacute;n, con clases de 2.30 hs. reloj. <strong>INICIO: Martes 21/4</strong></li><li><strong>1 (uno) curso de Microsoft Excel Avanzado</strong> con una carga horaria de 24 hs. de duraci&oacute;n cada curso, con clases de 2.30 hs. reloj. <strong>INICIO: Lunes 20/4</strong></li></ul><p>&nbsp;</p>'),
(20, 'CERTIFICADOS DIGITALIZADOS IPAP CHACO', 'descargarcertificados', '<div class="yiv7250853508" align="center">&nbsp;</div><div id="yiv7250853508yui_3_16_0_1_1429364372051_2465" class="yiv7250853508"><strong id="yui_3_16_0_1_1429364372051_10059" class="yiv7250853508">Estimado participante&nbsp;Ud. podr&aacute; acceder a certificados digitalizados de actividades realizadas en el a&ntilde;o&nbsp;2014 en adelante .&nbsp;Estaremos informando aqu&iacute; &nbsp;los cursos disponibles para la descarga.</strong></div><div class="yiv7250853508">&nbsp;</div><div class="yiv7250853508" style="text-align: center;"><a href="http://certificados.ipap.chaco.gov.ar/"><span class="yiv7250853508"><strong class="yiv7250853508">Descargar Certificado&nbsp;Aqu&iacute;</strong></span></a></div><div class="yiv7250853508" style="text-align: center;">&nbsp;</div><div class="yiv7250853508" style="text-align: center;">&nbsp;</div><div class="yiv7250853508" style="text-align: center;"><span class="yiv7250853508"><strong class="yiv7250853508">CONSULTAS: ipapchaco@gmail.com</strong></span></div><div class="yiv7250853508">&nbsp;</div><div class="yiv7250853508">&nbsp;</div><div class="yiv7250853508">Certificados disponibles:</div><div class="yiv7250853508">&nbsp;</div><div class="yiv7250853508"><strong>2016:</strong></div><div class="yiv7250853508">&nbsp;</div><div class="yiv7250853508">1.&nbsp;CONFERENCIA MUNICIPIOS SUSTENTABLES.</div><div class="yiv7250853508">&nbsp;</div><div class="yiv7250853508">2.&nbsp;MESAS DE ENTRADAS DE LA ADMINISTRACI&Oacute;N P&Uacute;BLICA PROVINCIAL - NORMATIVA Y SISTEMAS.</div><div class="yiv7250853508">&nbsp;</div><div class="yiv7250853508">3.&nbsp;BUENAS PR&Aacute;CTICAS ARCHIV&Iacute;STICAS. DE LA ORGANIZACI&Oacute;N A LA CONSERVACI&Oacute;N- 1&ordm; EDICI&Oacute;N.&nbsp;</div><div class="yiv7250853508">&nbsp;</div><div class="yiv7250853508">4.&nbsp;El ACTO ADMINISTRATIVO, PROCEDIMIENTO Y RECURSOS.</div><div class="yiv7250853508">&nbsp;</div><div class="yiv725085