ato digno en las relaciones de consumo</p><p>2. &nbsp; &nbsp;Excel avanzado</p><p>3. &nbsp; &nbsp;Gesti&oacute;n de bienes propiedad del estado provincial</p><p>4. &nbsp; &nbsp;Ley N&ordm; 4787 nivel b&aacute;sico</p><p>5. &nbsp; &nbsp;Organizaci&oacute;n del estado provincial</p><p>6. &nbsp; &nbsp;Servicio de excelencia en atenci&oacute;n al usuario</p><p>7. &nbsp; &nbsp;Word avanzado</p><p>8. &nbsp; &nbsp;Trabajo en equipo</p><p>9. &nbsp; &nbsp;Trabajo en equipo atenci&oacute;n al ciudadano</p><p>10. &nbsp;Herramientas para la comunicaci&oacute;n eficaz y oratoria</p><p>11. &nbsp;An&aacute;lisis y redacci&oacute;n de instrumentos legales</p><p>12. &nbsp;Deberes y derechos del empleado de la administraci&oacute;n p&uacute;blica provincial</p><p>13. &nbsp;Synfony 2</p><p>14. &nbsp;Archivos administrativos - M&eacute;todos y procedimientos de organizaci&oacute;n</p><p>15. &nbsp;Comunicaci&oacute;n asertiva, liderazgo y estrategia institucional</p><p>16. &nbsp;Mesa de entradas de la administraci&oacute;n p&uacute;blica provincial, normativas &nbsp;y sistemas</p><p>17. &nbsp;Compromiso con el aprendizaje</p><p>18. &nbsp;Ley 2017 estatuto del empleado p&uacute;blico</p><p>19. &nbsp;Ley 3521 r&eacute;gimen de licencias</p><p>20. &nbsp;Organizaci&oacute;n del estado</p><p>21. &nbsp;Redacci&oacute;n de instrumentos legales</p><p>22. &nbsp;Reglamentaciones vigentes en materia de personal</p><p>23. &nbsp;La accesibilidad en el servicio p&uacute;blico y el trato a personas con discapacidad</p><p>24. &nbsp;Liderazgo y conducci&oacute;n de equipos de trabajo</p><p>25. &nbsp;Integraci&oacute;n de herramientas avanzadas (Word, Excel y Access)</p><p>26. &nbsp;Integraci&oacute;n de herramientas b&aacute;sicas (Word, Excel y Access)</p><p>27. &nbsp;Actualizaci&oacute;n sobre normativa de tr&aacute;nsito y seguridad vial</p><p>28. &nbsp;Pr&aacute;ctica de conducci&oacute;n de equipos de trabajo</p><p>29. &nbsp;Trabajo en equipo y motivaci&oacute;n personal</p><p>30. &nbsp;Charla trato digno en las relaciones de consumo</p><p>31. &nbsp;Integraci&oacute;n de herramientas b&aacute;sicas (Windows, Word y Excel)</p><p>32. &nbsp;Ley N&ordm; 4787</p><p>33. &nbsp;Servicio de atenci&oacute;n al ciudadano</p><p>34. &nbsp;Dise&ntilde;o y construcci&oacute;n de investigaciones aplicadas-Modulo 1</p><p>35. &nbsp;Dise&ntilde;o y construcci&oacute;n de investigaciones aplicadas-Modulo 2</p><p>36. &nbsp;Ley N&ordm; 3521 r&eacute;gimen de licencias</p><p>37. &nbsp;Mesa de entradas de la administraci&oacute;n p&uacute;blica provincial - Normativas y sistemas</p><p>38. &nbsp;Formulaci&oacute;n del presupuesto de la provincia&nbsp; del Chaco - aspectos pr&aacute;cticos</p><p>39. &nbsp;Trabajo en equipo- modalidad virtual</p><p>40. &nbsp;Lengua de se&ntilde;as: una herramienta de inclusi&oacute;n-Nivel I</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p></div><div class="yiv7250853508">&nbsp;</div>'),
(21, 'Proyectos Vigentes 2014-2015', 'proyectosacreditados', '<h4>16 proyectos de investigaci&oacute;n han sido aprobados como resultado de la Convocatoria de presentaci&oacute;n de proyectos de investigaci&oacute;n destinada a Agentes de la Administraci&oacute;n P&uacute;blica Provincial que deseen resolver problemas, en base a metodolog&iacute;as de investigaci&oacute;n, en sus jurisdicciones u &oacute;rganos del Estado.</h4><p><br /><br /></p><p><strong>Proyectos aprobados</strong></p><p>*Planificaci&oacute;n de tareas en la Tesorer&iacute;a General de la Provincia (Tesorer&iacute;a General)</p><p>*Mejoras Continuas en la Secretar&iacute;a General (Tesorer&iacute;a)</p><p>*El an&aacute;lisis de la gesti&oacute;n y las finanzas p&uacute;blicas en los municipios de primera categor&iacute;a (Tesorer&iacute;a General)</p><p>*Criterios de distribuci&oacute;n de soluciones habitacionales seg&uacute;n la din&aacute;mica del sistema urbano (IPDUV)</p><p>*Apertura Institucional, generando espacios de democratizaci&oacute;n para la protecci&oacute;n integral (Ministerio de Desarrollo Social)</p><p>*Determinaci&oacute;n de la relaci&oacute;n insumo-producto en el &aacute;rea de Turismo Social del Programa Desarrollo Social (Ministerio de Desarrollo Social)</p><p>*El camino de la Ley: Identificaci&oacute;n del proceso de calidad en tr&aacute;mite parlamentario (Poder Legislativo)</p><p>*Auditor&iacute;a interna de Recursos Humanos, procesos para identificar oportunidades y sistematizar &aacute;reas cr&iacute;ticas, construyendo una matriz de riesgo institucional (Poder Legislativo) *La Funci&oacute;n P&uacute;blica (ProFyM &ndash; IPAP)</p><p>*An&aacute;lisis sobre retenci&oacute;n y motivaci&oacute;n de alumnos en capacitaciones ofrecidas por IPAP (IPAP) *Identificaci&oacute;n del tratamiento &oacute;ptimo para los efluentes l&iacute;quidos en conjunto del parque industrial de Puerto Tirol (APA)</p><p>*Evaluaci&oacute;n del grado de eficiencia del sistema de calidad ISO 9001-2008 en el laboratorio de aguas de la APA (APA)</p><p>*Creaci&oacute;n de un panel de donantes fenotipados en el Centro de Hemoterapia (Ministerio de Salud P&uacute;blica)</p><p>*Evaluaci&oacute;n de la Alimentaci&oacute;n Complementaria en ni&ntilde;os menores de dos a&ntilde;os en los centros de atenci&oacute;n primaria&nbsp; (Ministerio de Salud P&uacute;blica)</p><p>*Criterios del Premio Provincial de la Calidad en la ATP (ATP)</p><p>*Buenas pr&aacute;cticas en la administraci&oacute;n estrat&eacute;gica de Bienes del Estado (Direcci&oacute;n General de Bienes).</p><p>&nbsp;</p>'),
(22, '1ª Jornada Provincial sobre Prospectiva en el Estado', 'primerajornadaprovincialprospectiva', '<p>El 3 de setiembre se realiz&oacute; la 1&ordf; Jornada Provincial sobre Prospectiva en el Estado en la que expertos en&nbsp;la tem&aacute;tica provenientes del Ministerio de Ciencia, Tecnolog&iacute;a e Innovaci&oacute;n Productiva, el Instituto Nacional de Tecnolog&iacute;a Agropecuaria, del Instituto de Prospectiva y Pol&iacute;ticas P&uacute;blicas, del Ministerio de Planificaci&oacute;n Federal, Inversi&oacute;n P&uacute;blica y Servicios y de la Universidad Nacional de Cuyo compartieron experiencias exitosas a nivel Nacional y Regional brindando en cada disertaci&oacute;n su experiencia y conocimiento. La actividad se lev&oacute; a cabo en el Sal&oacute;n Casablanca del Hotel Amerian de la ciudad de Resistencia, Chaco.</p><p>Las Conferencias trataron temas como:</p><p>-La prospectiva en el Estado: presente y futuro:&nbsp;<a href="../../uploads/publicacion/87e9a3ef6e6342afbfdce9223a80f6ca652f4b71.pdf" target="_blank">Material del Dr.Ing. Mart&iacute;n Villanueva</a></p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<a href="../../uploads/publicacion/cc679e1efc29ca8e57c47f834f0d69c7bbed874d.pdf" target="_blank">Material Lic. Rub&eacute;n Patrouilleau</a></p><p>-Prospectiva Tecnol&oacute;gica:&nbsp;<a href="../../uploads/publicacion/47bfca1aab4a98d33c8cb8505871007d9831a974.pdf" target="_blank">Material de Lic. Adriana S&aacute;nchez Rico</a></p><p>-Prospectiva Ambiental:&nbsp;<a href="../../uploads/publicacion/3872099e30d169c7d887130e2aa6897aaecc1c07.pdf" target="_blank">Material de Lic. Adolfo Medalla Araya</a></p><p>-Prospectiva Regional:&nbsp;<a href="../../uploads/publicacion/190b874e61531654b23affef62d95b466e40ba16.pdf" target="_blank">Material de Ing. Agr. Vicente Rister</a></p><p>-Prospectiva Nacional:&nbsp;<a href="../../uploads/publicacion/bb487b9353951e4e2a515cb4c136903766670d08.pdf" target="_blank">Material de Arq. Mariana Kossoy</a></p><p>Dentro del marco de la Jornada, se realiz&oacute; adem&aacute;s el Taller "Anticipaci&oacute;n estrat&eacute;gica y prospectiva en el Estado moderno" dictado or el Mgter. Eduardo Balbi quien brinda a los presentes una herramienta metodol&oacute;gica para iniciar, en el Estado Provincial, la pr&aacute;ctica de planificar futuros de crecimiento y competitividad.</p><p><a href="../../uploads/publicacion/7be7fb37023c3c214383ff3929e1a8fc54841357.pdf" target="_blank">M&oacute;dulo 1-Material</a></p><p><a href="../../uploads/publicacion/14c506fac42a762258d1654d92e9b6012c50ab73.pdf" target="_blank">M&oacute;dulo 2-Material</a></p><p>&nbsp;</p>');
