INSERT INTO `test` (`id`, `test_tematica_id1`, `test_tipo_id1`, `titulo`, `descripcion`, `porcentaje_aprobacion`, `puntaje_maximo`, `habilitado`, `fecha_creacion`, `fecha_inicio`, `fecha_fin`, `mensaje_aprobado`, `mensaje_desaprobado`) VALUES
(1, 1, 1, 'MICROSOFT EXCEL - NIVEL AVANZADO', 'Este es un test para poder realizar el curso de Microsoft Excel Nivel Avanzado. Una vez que apruebe este test, no hace falta que lo realice otra vez.', 60, 100, 'SI', '2016-05-06 00:00:00', '2016-05-06 00:00:00', '2016-05-31 00:00:00', 'Usted está habilitado a pre-inscribirse al curso "Microsoft Excel - Nivel Avanzado". Para pre-inscribirse a Excel Avanzado ingrese <a href="http://ipap.chaco.gov.ar/seccion/cursos_excel_avanzado">AQUÍ</a>', 'Recomendamos volver a realizar este test para actualizar sus conocimientos, o bien, realice el curso de Excel Básico. Para pre-inscribirse a Excel Básico ingrese <a href="http://ipap.chaco.gov.ar/seccion/cursos_ofimatica">AQUÍ</a>'),
(2, 1, 1, 'MICROSOFT WORD - NIVEL AVANZADO', 'Este es un test para poder realizar el curso de Microsoft Word Nivel Avanzado. Una vez que apruebe este test, no hace falta que lo realice otra vez.', 60, 100, 'NO', '2016-05-26 00:00:00', '2016-05-30 00:00:00', '2016-07-27 00:00:00', 'Usted está habilitado a pre-inscribirse al curso "Microsoft Word - Nivel Avanzado". Para ver los horarios y pre-inscribirse haga clic  <a href="http://ipap.chaco.gov.ar/seccion/cursos_word_avanzado">AQUÍ</a>', 'Recomendamos volver a realizar este test para actualizar sus conocimientos, o bien, realice el curso de Word Básico. Para pre-inscribirse al curso de Word Básico, haga clic <a href="http://ipap.chaco.gov.ar/seccion/cursos_ofimatica">AQUÍ</a>'),
(3, 1, 1, 'MICROSOFT WORD - NIVEL AVANZADO', 'Este es un test para poder realizar el curso de Microsoft Word Nivel Avanzado. Una vez que apruebe este test, no hace falta que lo realice otra vez.', 60, 100, 'SI', '2017-04-06 00:00:00', '2017-04-06 00:00:00', NULL, 'Usted está habilitado a pre-inscribirse al curso "Microsoft Word - Nivel Avanzado". Para ver los horarios y pre-inscribirse haga clic  <a href="http://ipap.chaco.gov.ar/alumno/cursos/todos">AQUÍ</a>', 'Recomendamos volver a realizar este test para actualizar sus conocimientos, o bien, realice el curso de Word Básico. ');
