INSERT INTO `test_alumno_respuestas` (`test_alumno_id`, `id`, `pregunta`, `respuesta`, `verificacion`, `test_preguntas_id`, `test_opciones_id`) VALUES
(4, 21, 'Para cambiar el nombre de la hoja1 del libro proporcionado hice:	', 'Click con el Botón derecho del mouse sobre Hoja1 y luego click en Insertar.', 'FALSO', 1, 1),
(4, 22, 'Para configurar el tamaño de la página hice:', 'Click en la ficha Vista y luego click en Diseño de página.', 'FALSO', 2, 5),
(4, 23, 'Para configurar la orientación de la página hice:', 'No es posible configurarlo, tengo que colocar la hoja en la posición solicitada para poder imprimir de esa manera.', 'FALSO', 3, 12),
(4, 24, 'Para configurar los márgenes de la página hice:', 'Click en la ficha Diseño de página y luego click en Márgenes seleccionando uno de los disponibles.', 'FALSO', 4, 17),
(4, 25, 'Para el formato de las columnas <b>Ventas, Sueldo y Monto Comisión</b> (no los títulos) hice: ', 'Click en la flechita negra al lado de General (como muestra en la imagen de la derecha), seleccioné Más formatos de número y allí elegí la categoría solicitada modificando valores.\r\n</br><img src="documentos/MSEXCEL-AVANZADO/images/general.jpg" alt="Configurar pagina" width="150">', 'VERDADERO', 5, 25),
(4, 26, 'Luego de resolver la consigna <b>2.1)</b> la función completa en la celda <b>G10</b> es:	', '=SI(E10 => 14500;E10*12%;"")', 'FALSO', 6, 28),
(4, 27, 'Luego de resolver la consigna 2.2) la función completa en la celda I7 es:', '=CONTAR.SI(C2:C64;Resistencia)', 'FALSO', 7, 35),
(4, 28, 'Luego de resolver la consigna 3.3) el Rango de Datos del Gráfico es el siguiente:	', '=$A$2:$B$7', 'FALSO', 8, 42),
(4, 29, 'Luego de resolver la consigna 3.3) para colocar el título al Gráfico hice lo siguiente: ', 'No se puede colocar el título porque el gráfico no me deja.', 'FALSO', 9, 49),
(4, 30, 'Luego de resolver la consigna 3.4) para agregar etiqueta de datos hice lo siguiente: ', 'No se puede colocar el título porque el gráfico no me deja.', 'FALSO', 10, 54),
(5, 31, 'Luego de resolver la consigna 1.1) para configurar los márgenes de la página hice:	', 'No es posible configurarlo, debo recortar la hoja luego de imprimirla.', 'FALSO', 11, 65),
(5, 32, 'Luego de resolver la consigna 1.1) para configurar el tamaño de la página hice:', 'Todas las opciones son correctas.', 'FALSO', 12, 68),
(5, 33, 'Luego de resolver la consigna 2.1) para centrar la Tabla respecto de la hoja hice:		', 'Seleccioné la tabla haciendo click en la cruz que aparece en el extremo superior izquierdo de la misma (como se muestra en la imagen), y luego hice click en Alineación Centrar.\r\n</br><img src="documentos/MSWORD-AVANZADO/images/azul.jpg" alt="Seleccionar tabla" width="50">', 'VERDADERO', 13, 77),
(5, 34, 'Luego de resolver la consigna 2.1) para combinar las celdas de la primera fila de la tabla hice:', 'Eliminé la primera fila de cada columna y escribí arriba de la tabla el título de la misma.', 'FALSO', 14, 80),
(5, 35, 'Luego de resolver la consigna 2.1) para aplicar el sombreado color azul al texto hice: ', 'Posicioné el cursor en la celda, luego en la ficha Presentación elegí Propiedades de Tabla, hice click en Bordes y Sombreado, y allí en Sombreado seleccioné el color del Relleno solicitado.', 'VERDADERO', 15, 88),
(5, 36, 'Para guardar los cambios en el documento de Word Notas_TPI_Apellido hice lo siguiente:	', 'Click en el ícono Guardar que se encuentra en la barra de acceso rápido.', 'VERDADERO\r\n', 16, 94),
(5, 37, 'Para resolver las consignas desde la 3.2) hasta la 3.6) tuve que:	', 'Cargar la lista en Word copiando los datos desde Excel.', 'FALSO', 17, 99),
(5, 38, 'Luego de resolver la consigna 3.8), al abrir nuevamente el archivo Saludos_AñoNuevo_TPI_Apellido:', 'Aparece un mensaje indicando que se ejecutará un comando SQL.', 'VERDADERO', 18, 105),
(5, 39, 'Para resolver la consigna 3.3) hice lo siguiente: 	', 'Fui a la ficha Correspondencia, luego en la opción Editar lista de destinatarios tuve que hacer click en la flechita al lado del campo Ciudad para ordenarla, pero al mismo tiempo no se puede ordenar por Apellido también porque se pierde el ordenamiento por Ciudad.', 'FALSO', 19, 111),
(5, 40, 'Luego de resolver todos los ítems del Ejercicio Nº 3, en el documento Saludos_AñoNuevo_TPI_Apellido:', 'En la esquina superior derecha no aparece nada y a la derecha de la palabra Hola también no hay nada.', 'FALSO', 20, 123),
(6, 41, 'Para cambiar el nombre de la hoja1 del libro proporcionado hice:	', 'Doble click sobre Hoja1.', 'VERDADERO', 1, 2),
(6, 42, 'Para configurar el tamaño de la página hice:', 'Click en la ficha Diseño de página y luego click en Tamaño seleccionando el solicitado.', 'VERDADERO', 2, 7),
(6, 43, 'Para configurar la orientación de la página hice:', 'Click en la ficha Diseño de página y luego click en Orientación seleccionando la solicitada.', 'VERDADERO', 3, 16),
(6, 44, 'Para configurar los márgenes de la página hice:', 'Click en la ficha Diseño de página, después click en Márgenes y una vez allí hice click en márgenes personalizados para colocar los márgenes solicitados.', 'VERDADERO', 4, 18),
(6, 45, 'Para el formato de las columnas <b>Ventas, Sueldo y Monto Comisión</b> (no los títulos) hice: ', 'Con las celdas seleccionadas, click con el botón derecho del mouse sobre ellas y seleccioné Formato de celdas haciendo click en la categoría solicitada y modificando los valores.', 'VERDADERO', 5, 23),
(6, 46, 'Luego de resolver la consigna <b>2.1)</b> la función completa en la celda <b>G10</b> es:	', '=SI(E10 >= 14500;E10*0,12;"")', 'VERDADERO', 6, 31),
(6, 47, 'Luego de resolver la consigna 2.2) la función completa en la celda I7 es:', '=CONTAR.SI(C2:C64;"Resistencia")', 'VERDADERO', 7, 38),
(6, 48, 'Luego de resolver la consigna 3.3) el Rango de Datos del Gráfico es el siguiente:	', '=Gráfico!$A$2:$B$7', 'VERDADERO', 8, 44),
(6, 49, 'Luego de resolver la consigna 3.3) para colocar el título al Gráfico hice lo siguiente: ', 'Teniendo seleccionado el gráfico, fui a la ficha Presentación, hice click en Títulos del Gráfico y seleccioné Encima del Gráfico.', 'VERDADERO', 9, 48),
(6, 50, 'Luego de resolver la consigna 3.4) para agregar etiqueta de datos hice lo siguiente: ', 'Seleccioné las barras del gráfico, hice click derecho del mouse y seleccione Agregar etiqueta de datos.', 'VERDADERO', 10, 55),
(7, 51, 'Para cambiar el nombre de la hoja1 del libro proporcionado hice:	', 'Click con el Botón derecho del mouse sobre Hoja1 y luego click en cambiar nombre.', 'VERDADERO', 1, 4),
(7, 52, 'Para configurar el tamaño de la página hice:', 'Click en la ficha Diseño de página y luego click en Tamaño seleccionando el solicitado.', 'VERDADERO', 2, 7),
(7, 53, 'Para configurar la orientación de la página hice:', 'Click en la ficha Diseño de página y luego click en Orientación seleccionando la solicitada.', 'VERDADERO', 3, 16),
